(1, NULL, 1, '2020-07-15 04:20:14', '2020-09-21 05:19:41', 'Thời Trang', '<p>B&igrave;nh tĩnh sống</p>\r\n\r\n<p>Nơi t&ocirc;i ở c&oacute; dăm chị em n&ocirc;ng th&ocirc;n ra H&agrave; Nội h&agrave;nh nghề thu gom phế liệu. &ldquo;L&agrave;m nghề n&agrave;y thu nhập ổn kh&ocirc;ng?&rdquo;, t&ocirc;i hỏi một chị.</p>\r\n\r\n<p>&nbsp;</p>', 'thoi-trang'),
(2, NULL, 1, '2020-07-15 04:20:31', '2020-08-24 04:52:03', 'Thông tin cần biết', '<p>django-image-cropping delegates the cropped image generation to a backend. A backend based on easy-thumbnails is provided, but it&#39;s possible to use a custom backend. The IMAGE_CROPPING_BACKEND setting expects a dotted path to a class that implements the required methods. You can omit this setting if you want to use the default backend. In case you use a custom backend you can provide an optional dict that will be used to populate the backend&#39;s constructor params. Default settings: IMAGE_CROPPING_BACKEND = &#39;image_cropping.backends.easy_thumbs.EasyThumbnailsBackend&#39; IMAGE_CROPPING_BACKEND_PARAMS = {} Frontend django-image-cropping provides a templatetag for displaying a cropped thumbnail. Any other processor parameter (like bw=True or upscale=True) will be forwarded to the backend:</p>', 'thong-tin-can-biet'),
(3, NULL, 0, '2020-08-17 04:33:31', '2020-09-21 05:19:36', 'Sản phẩm Gia Dụng', '<p>thu muc moithu muc moithu muc moithu muc moithu muc moithu muc moithu muc moithu muc moithu muc moithu muc moi</p>', 'san-pham-gia-dung'),
(4, NULL, 1, '2020-08-19 06:49:50', '2020-09-21 05:19:48', 'Linh Kiện Điện Tử', '<p>Trung Quốc cho ph&eacute;p sử dụng c&aacute;c vaccine Covid-19 chưa được ph&ecirc; duyệt do một số c&ocirc;ng ty ở nước n&agrave;y ph&aacute;t triển trong trường hợp khẩn cấp.</p>\r\n\r\n<p>Việc cấp ph&eacute;p sử dụng khẩn cấp dựa tr&ecirc;n Luật Quản l&yacute; Vaccine Trung Quốc, cho ph&eacute;p sử dụng những ứng vi&ecirc;n vaccine chưa qua ph&ecirc; duyệt với những người c&oacute; nguy cơ l&acirc;y nhiễm cao trong một khoảng thời gian giới hạn.</p>', 'p-su-dung-cac-vaccine-covid-19-chua-uoc-phe'),
(5, NULL, 1, '2020-09-15 09:06:50', '2020-09-21 05:19:54', 'Mẫu sản phẩm hình đứng', '<p>Mẫu sản phẩm h&igrave;nh đứng</p>', 'mau-san-pham-hinh-ung'),
(6, NULL, 1, '2020-09-15 09:07:13', '2020-09-21 05:20:05', 'Mẫu sản phẩm hình nằm ngang', '<p>Mẫu sản phẩm h&igrave;nh nằm ngang</p>', 'mau-san-pham-hinh-nam-ngang');
