(57, 23, NULL, 1, '<p>Trả lời b&aacute;o ch&iacute; h&ocirc;m 6/10, ứng vi&ecirc;n đảng D&acirc;n chủ Joe Biden b&agrave;y tỏ mong muốn &quot;c&oacute; thể tranh luận&quot; với Tổng thống Donald Trump, nhưng cho hay họ phải &quot;tu&acirc;n thủ c&aacute;c hướng dẫn v&ocirc; c&ugrave;ng nghi&ecirc;m ngặt&quot;.</p>', '2020-10-07 01:56:39', '2020-10-07 01:56:39', 'PUBLISHED', NULL),
(58, 21, NULL, 1, '<p>Trả lời b&aacute;o ch&iacute; h&ocirc;m 6/10, ứng vi&ecirc;n đảng D&acirc;n chủ Joe Biden b&agrave;y tỏ mong muốn &quot;c&oacute; thể tranh luận&quot; với Tổng thống Donald Trump, nhưng cho hay họ phải &quot;tu&acirc;n thủ c&aacute;c hướng dẫn v&ocirc; c&ugrave;ng nghi&ecirc;m ngặt&quot;.</p>', '2020-10-07 01:57:08', '2020-10-07 01:57:08', 'PUBLISHED', NULL),
(59, 21, NULL, 1, '<p>Cựu ph&oacute; tổng thống Mỹ n&oacute;i th&ecirc;m rằng &ocirc;ng kh&ocirc;ng nhận được th&ocirc;ng tin về t&igrave;nh h&igrave;nh sức khỏe của Trump kể từ khi Tổng thống Mỹ trở về Nh&agrave; Trắng. Trump th&ocirc;ng b&aacute;o nhiễm nCoV h&ocirc;m 2/10, chưa đầy 24 giờ sau được đưa tới Trung t&acirc;m Qu&acirc;n y Walter Reed, bang Maryland, v&agrave; điều trị tại đ&acirc;y trong ba ng&agrave;y.</p>', '2020-10-07 01:57:49', '2020-10-07 01:57:49', 'PUBLISHED', NULL),
(60, 21, NULL, 1, '<p>Buổi tranh luận tổng thống thứ hai dự kiến được tổ chức v&agrave;o ng&agrave;y 15/10 tại Trung t&acirc;m Biểu diễn Nghệ thuật Adrienne Arsht ở th&agrave;nh phố Miami, bang Florida. Theo Ủy ban Tranh luận Tổng thống, buổi tranh luận n&agrave;y sẽ diễn ra dưới h&igrave;nh thức &quot;t&ograve;a thị ch&iacute;nh&quot;, nơi cư d&acirc;n Miami đặt c&acirc;u hỏi cho c&aacute;c ứng vi&ecirc;n thay v&igrave; người điều h&agrave;nh như cuộc đầu ti&ecirc;n.</p>', '2020-10-07 01:58:51', '2020-10-07 01:58:51', 'PUBLISHED', NULL),
(61, 21, NULL, 1, '<p>Trong cập nhật mới nhất h&ocirc;m 6/10, b&aacute;c sĩ Nh&agrave; Trắng Sean Conley cho biết Trump tiếp tục &quot;rất khoẻ&quot; v&agrave; kh&ocirc;ng c&ograve;n c&aacute;c triệu chứng của Covid-19. &Ocirc;ng đ&atilde; gặp một nh&oacute;m y b&aacute;c sĩ tại tư dinh v&agrave;o buổi s&aacute;ng sau &quot;một đ&ecirc;m đầu ti&ecirc;n nghỉ ngơi tại nh&agrave;&quot;.</p>', '2020-10-07 02:00:12', '2020-10-07 02:00:12', 'PUBLISHED', NULL),
(62, 24, NULL, 1, '<p>Mặc d&ugrave; phương ph&aacute;p n&agrave;y phổ biến tr&ecirc;n thế giới v&agrave; hiện được nhiều lĩnh vực tại Việt Nam như Hải Quan, Bảo hiểm, Thuế, sử dụng, &ocirc;ng Cường cho biết phương ph&aacute;p n&agrave;y hiện chưa được c&aacute;c ng&acirc;n h&agrave;ng ph&aacute;t triển v&igrave; một số r&agrave;o cản về ph&aacute;p l&yacute; khi d&ugrave;ng tr&ecirc;n di động. Đồng thời chữ k&yacute; số c&ograve;n bất tiện hơn so với OTP khi chuyển đổi giao dịch giữa c&aacute;c thiết bị kh&aacute;c nhau.</p>', '2020-10-07 07:52:47', '2020-10-07 07:52:47', 'PUBLISHED', NULL),
(63, 24, NULL, 1, '<p>Chuy&ecirc;n gia bảo mật Nguyễn Văn Cường cho rằng, c&aacute;c dịch vụ, đặc biệt dịch vụ ng&acirc;n h&agrave;ng cần c&oacute; cảnh b&aacute;o đến người d&ugrave;ng khi ph&aacute;t hiện đăng nhập từ một thiết bị mới. Ngo&agrave;i ra, c&aacute;c đơn vị n&agrave;y c&oacute; thể ứng dụng phương ph&aacute;p bảo mật bằng chữ k&yacute; số. &quot;Chữ k&yacute; số&quot; l&agrave; một thiết bị cắm ngo&agrave;i, hoặc nằm tr&ecirc;n thiết bị nhưng định danh gắn liền với thiết bị đ&oacute;. Ưu điểm của chữ k&yacute; số l&agrave; x&aacute;c định được nguồn gốc người gửi, do đ&oacute; n&oacute; c&oacute; t&iacute;nh chất &quot;chống chối bỏ&quot; v&agrave; được ph&aacute;p luật bảo hộ theo Nghị Định 130/2018/NĐ-CP.</p>', '2020-10-07 07:54:47', '2020-10-07 07:54:47', 'PUBLISHED', NULL),
(64, 24, NULL, 1, '<p>Theo c&aacute;c chuy&ecirc;n gia bảo mật, người d&ugrave;ng c&oacute; thể tự ph&ograve;ng tr&aacute;nh c&aacute;c nguy cơ bị chiếm t&agrave;i khoản bằng c&aacute;ch kh&ocirc;ng click v&agrave;o c&aacute;c link lạ, đặc biệt l&agrave; khi thực hiện giao dịch tiền bạc. Người d&ugrave;ng kh&ocirc;ng c&agrave;i đặt ứng dụng lạ từ c&aacute;c nguồn kh&ocirc;ng ch&iacute;nh thống. Khi c&agrave;i đặt phần mềm mới, kh&ocirc;ng cung cấp qu&aacute; nhiều quyền cho c&aacute;c ứng dụng, như đọc SMS, truy cập Internet... nếu kh&ocirc;ng cần thiết. Ngo&agrave;i ra, những người smartphone cũng n&ecirc;n sử dụng c&aacute;c phần mềm chống m&atilde; độc để bảo vệ thiết bị.</p>', '2020-10-07 07:55:14', '2020-10-07 07:55:14', 'PUBLISHED', NULL),
(65, 23, NULL, 1, '<p>đầu ti&ecirc;n l&agrave; Spotify. Năm 2019, Spotify đ&atilde; đệ đơn kiện Apple về khoản ph&iacute; 30% m&agrave; c&aacute;c nh&agrave; ph&aacute;t triển phải chia sẻ với Apple. Sự đ&aacute;p trả của Apple d&agrave;nh cho Spotify cũng đầy đủ v&agrave; r&otilde; r&agrave;ng như với Epic: trong con mắt của nh&agrave; T&aacute;o, dịch vụ stream nhạc số 1 thế giới đơn giản l&agrave; chỉ muốn tận hưởng đầy đủ c&aacute;c lợi thế về cộng đồng người d&ugrave;ng, c&aacute;c c&ocirc;ng cụ ph&aacute;t triển, hệ thống thanh to&aacute;n</p>', '2020-10-07 16:45:46', '2020-10-07 16:45:46', 'PUBLISHED', NULL),
(66, 23, NULL, 1, '<p>n Unreal Engine (nền tảng ph&aacute;t triển game của Epic). Tuy t&ograve;a &aacute;n kh&ocirc;ng cho ph&eacute;p Apple thực hiện động th&aacute;i tr&ecirc;n, r&otilde; r&agrave;ng l&agrave; Tim Cook chẳng cần tung đ&ograve;n m&agrave; đối thủ đ&atilde; đau: theo khẳng định từ ch&iacute;nh Epic, nhiều nh&agrave; ph&aacute;t triển đ&atilde; từ bỏ Unreal Engine v&igrave; e ngại về tương lai bấp b&ecirc;nh của nền tảng n&agrave;y.</p>', '2020-10-07 16:46:31', '2020-10-07 16:46:31', 'PUBLISHED', NULL),
(67, 22, NULL, 1, '<p>Let us consider a scenario where we create user profile and update/edit the profile ... We did not add &quot;user&quot; in the fields because it is not something that the user&nbsp;...</p>', '2020-10-09 02:11:42', '2020-10-09 02:11:42', 'PUBLISHED', NULL),
(68, 23, NULL, 1, '<p>Django has many tools and libraries that make form building much simpler. ... In this form, I have defined two text fields and a submit button. ... We&#39;re not doing anything with the submitted form right now, so we put in an assertion error to ... admin access to the backend, so we will create a form they can fill out in the frontend.</p>', '2020-10-09 02:12:18', '2020-10-09 02:12:18', 'PUBLISHED', NULL);
