(1259, '2020-10-03 19:42:41.883484', '2', 'ớng Nguyễn Hải Trung trong buổi lễ nhận quyết định bổ nhiệm của lãnh đạo Bộ Công an. Ảnh: Lam Thanh. Thiếu tướng Nguyễn Hải Trung (phải) trong buổi lễ nhận quyết định bổ nhiệm của lãnh đạo Bộ Công an ', 2, '[{"changed": {"fields": ["Title", "slug"]}}]', 74, 1),
(1260, '2020-10-05 02:20:41.077572', '14', 'c là kẻ đầu tiên trong lịch sử dám cố tình thách thức Apple bằng cách đưa phương thức thanh toán riêng vào Fo', 2, '[{"changed": {"fields": ["Title", "slug"]}}]', 74, 1),
(1261, '2020-10-05 02:20:53.555690', '13', 'ên bản iOS, qua mặt khoản phí 30% của App Store. Ngay lập tức, Apple đã xóa Fortnite khỏi chợ ứng dụn', 2, '[{"changed": {"fields": ["Title", "slug"]}}]', 74, 1),
(1262, '2020-10-05 02:21:11.383084', '12', 'phép Apple thực hiện động thái trên, rõ ràng là Tim Cook chẳng cần tung đòn mà đối thủ đã đau: theo khẳng định từ chính Epic, nhiều nhà phát triển đã từ bỏ Unreal Engine vì e ngại về tương lai bấp', 2, '[{"changed": {"fields": ["Title", "slug"]}}]', 74, 1),
(1263, '2020-10-05 02:21:22.807879', '11', 'dọa loại bỏ tính năng đăng nhập Fortnite, Epic vội vã "la làng". Nhưng ít ngày sau, nhà Táo thủng thẳng tuyên bố với The Verge và Fox Business: đâu phải đâu, Apple chẳng hề có ý địn', 2, '[{"changed": {"fields": ["Title", "slug"]}}]', 74, 1),
(1264, '2020-10-05 02:21:34.434610', '10', 'hoản phí 30% mà các nhà phát triển phải chia sẻ với Apple. Sự đáp trả của Apple dành cho Spotify cũng đầy đủ và rõ ràng như với Epic: trong con mắt của nhà Táo, dịch vụ stream n', 2, '[{"changed": {"fields": ["Title", "slug"]}}]', 74, 1),
(1265, '2020-10-05 02:21:53.006074', '9', 'thế giới đơn giản là chỉ muốn tận hưởng đầy đủ các lợi thế về cộng đồng người dùng, các cô', 2, '[{"changed": {"fields": ["Title", "slug"]}}]', 74, 1),
(1266, '2020-10-05 02:22:05.269751', '8', 'i dung, Apple tạo ra cơ hội mới không chỉ cho chúng tôi, mà cho cả các nghệ sĩ, những người sáng tạ', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1267, '2020-10-05 02:22:17.581396', '7', 'rong cuộc chiến kéo dài từ iPhone X đến iPhone 11, Qualcomm không bán cho Apple bất kỳ một con chip modem nào cả - iPhone, iPad và các thiết bị Apple khác phải chuyển sang', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1268, '2020-10-05 02:22:28.710460', '6', 'thủ đã đặt chân vào thời đại 5G - và cũng là khi modem Intel thua đứt trước modem Qualcomm, hai bên mới tính đến chuyện dàn hòa vào đầu năm 2019. Nhưng trong lúc CEO của Qualc', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1269, '2020-10-05 02:22:42.997749', '5', 'chỉ nói "hài lòng" mà còn công bố luôn về thương vụ 1 tỷ USD để mua lại mảng phát triển chip 5', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1270, '2020-10-05 02:24:00.322676', '4', 'ntel. Đó mới là thông điệp thực sự của nhà Táo: thỏa thuận chỉ là tạm thời, Apple vẫn thừa ti', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1271, '2020-10-05 02:24:12.968028', '3', 'Facebook cũng luôn tìm cách chọc giận Apple. Trong vụ việc của Epic, Facebook đổ dầu vào lửa bằng tuyên bố Apple đã không cho phép công ty này được bỏ qua khoản phí 30% cho doa', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1272, '2020-10-05 02:24:25.880845', '1', 'kích từ Facebook, Apple chỉ... càng ngày càng thắt chặt các cơ chế quảng cáo trên iOS. Cuối tháng 8', 2, '[{"changed": {"fields": ["Title", "slug"]}}]', 74, 1),
(1273, '2020-10-05 02:24:38.814119', '15', 'Quả là không có cách nào để nhắc khéo Facebook hơn rằng, đến cuối cùng, mạng xã hội số 1 hành tinh vẫn chỉ là khách trên nền tảng di động có doanh thu cao nhất thế giới.', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1274, '2020-10-05 02:25:35.162485', '16', 'iPhone trở thành tâm điểm của vụ kiện giữa FBI và Apple. Theo Cơ quan Điều tra Liên bang Hoa Kỳ', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1275, '2020-10-05 02:26:10.260498', '17', 'Galaxy Z Fold 2 đã vượt qua được bài kiểm tra bụi bẩn mà bản tiền nhiệm đã phải bó tay', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1276, '2020-10-05 02:26:30.608665', '20', 'thiết bị có thể chống thấm nước hoặc chống bụi hoàn toàn nhưng thử nghiệm này cho thấy, điện thoại đã thể hiện rất', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1277, '2020-10-05 02:26:54.779788', '21', 'Tới bài kiểm tra hơ lửa, cả hai màn hình chính và phụ của máy gần như không gặp vấn đề gì khi màn hình có thể tự hồi sau khi bị hơ lửa.', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1278, '2020-10-05 02:28:27.963014', '22', 'Ảnh Chánh văn phòng Nhà Trắng gục đầu gây chú ý', 2, '[{"changed": {"fields": ["Title", "content", "slug"]}}]', 74, 1),
(1279, '2020-10-05 02:58:58.689344', '23', 'Điểm danh những nạn nhân đã từng nếm "độ mặn" của Apple', 1, '[{"added": {}}]', 74, 1),
(1280, '2020-10-07 07:49:52.043838', '24', 'Bảo mật bằng OTP vẫn có thể bị chiếm tài khoản ngân hàng', 1, '[{"added": {}}]', 74, 1);
