INSERT INTO `post` (`post_id`, `user_add_id`, `user_upd_id`, `category_id`, `title`, `slug`, `content`, `tags`, `date_add`, `date_upd`, `status`) VALUES
(1, 1, 1, 1, 'kích từ Facebook, Apple chỉ... càng ngày càng thắt chặt các cơ chế quảng cáo trên iOS. Cuối tháng 8', 'kich-tu-facebook-apple-chi-cang-ngay-cang-that-chat-cac-co-che-quang-cao-tren-ios-cuoi-thang-8', '<p>Thiếu tướng Nguyễn Hải Trung, Ph&oacute; chủ nhiệm Thường trực Ủy ban Kiểm tra Đảng ủy C&ocirc;ng an trung ương được bổ nhiệm l&agrave;m Gi&aacute;m đốc C&ocirc;ng an TP H&agrave; Nội. Quyết định điều động, bổ nhiệm được l&atilde;nh đạo Bộ C&ocirc;ng an trao cho thiếu tướng Nguyễn Hải Trung v&agrave;o s&aacute;ng 31/7, tại trụ sở C&ocirc;ng an TP H&agrave; Nội. &Ocirc;ng Trung nhận nhiệm vụ từ ng&agrave;y 1/8, thay cho người tiền nhiệm, trung tướng Đo&agrave;n Duy Khương, chờ nhận quyết định nghỉ hưu từ ng&agrave;y 1/9.</p>', 'sdsdfsd', '2020-07-15 04:21:12', '2020-10-05 02:24:26', 'PUBLISHED'),
(2, 1, 1, 2, 'ớng Nguyễn Hải Trung trong buổi lễ nhận quyết định bổ nhiệm của lãnh đạo Bộ Công an. Ảnh: Lam Thanh. Thiếu tướng Nguyễn Hải Trung (phải) trong buổi lễ nhận quyết định bổ nhiệm của lãnh đạo Bộ Công an sáng 31/7. Ảnh: Sơn Lâm. Tân g', 'ong-nguyen-hai-trung-trong-buoi-le-nhan-quyet-inh-bo-nhiem-cua-lanh-ao-bo-cong-an-anh-lam-thanh-thieu-tuong-nguyen-hai-trung-phai-trong-buoi-le-nhan-quyet-inh-bo-nhiem-cua-lanh-ao-bo-cong-an-sang-317-anh-son-lam-tan-g', '<p>Trong buổi lễ, Th&agrave;nh ủy H&agrave; Nội cũng chỉ định tướng Trung v&agrave;o Ban chấp h&agrave;nh, Ban Thường vụ, giữ chức B&iacute; thư Đảng ủy C&ocirc;ng an th&agrave;nh phố H&agrave; Nội. Thiếu tướng Nguyễn Hải Trung trong buổi lễ nhận quyết định bổ nhiệm của l&atilde;nh đạo Bộ C&ocirc;ng an. Ảnh: Lam Thanh. Thiếu tướng Nguyễn Hải Trung (phải) trong buổi lễ nhận quyết định bổ nhiệm của l&atilde;nh đạo Bộ C&ocirc;ng an s&aacute;ng 31/7. Ảnh: Sơn L&acirc;m. T&acirc;n gi&aacute;m đốc C&ocirc;ng an TP H&agrave; Nội 52 tuổi, qu&ecirc; Vĩnh Ph&uacute;c, từng đảm nhiệm c&aacute;c chức vụ như: Cục trưởng Tổ chức c&aacute;n bộ; Ph&oacute; tổng cục trưởng Tổng cục Ch&iacute;nh trị C&ocirc;ng an nh&acirc;n d&acirc;n, được phong h&agrave;m thiếu tướng năm 2018. Th&aacute;ng 8/2018, &ocirc;ng được điều động, bổ nhiệm giữ chức Gi&aacute;m đốc C&ocirc;ng an tỉnh Thanh H&oacute;a. Đến th&aacute;ng 6/2020, &ocirc;ng th&ocirc;i giữ chức vụ n&agrave;y v&agrave; được điều động l&agrave;m Ph&oacute; chủ nhiệm thường trực Ủy ban kiểm tra Đảng ủy C&ocirc;ng an Trung ương. Kể từ đầu th&aacute;ng 5 đến nay, Bộ C&ocirc;ng an bổ nhiệm h&agrave;ng chục chức danh l&atilde;nh đạo, trong đ&oacute; c&oacute; gần 10 gi&aacute;m đốc c&ocirc;ng an tỉnh v&agrave; gần 20 ph&oacute; gi&aacute;m đốc c&ocirc;ng an tỉnh c&ugrave;ng nhiều cục trưởng. Giải th&iacute;ch về việc bổ nhiệm, lu&acirc;n chuyển, l&atilde;nh đạo Bộ C&ocirc;ng an cho biết để chuẩn bị nh&acirc;n sự cho Đại hội Đảng c&aacute;c cấp, đảm bảo 100% c&aacute;n bộ, l&atilde;nh đạo kh&ocirc;ng phải l&agrave; người địa phương.</p>', 'sdfsdfsd sdfsfdfs', '2020-07-15 04:24:21', '2020-10-03 19:42:42', 'PUBLISHED'),
(3, 1, 1, 1, 'Facebook cũng luôn tìm cách chọc giận Apple. Trong vụ việc của Epic, Facebook đổ dầu vào lửa bằng tuyên bố Apple đã không cho phép công ty này được bỏ qua khoản phí 30% cho doa', 'facebook-cung-luon-tim-cach-choc-gian-apple-trong-vu-viec-cua-epic-facebook-o-dau-vao-lua-bang-tuyen-bo-apple-a-khong-cho-phep-cong-ty-nay-uoc-bo-qua-khoan-phi-30-cho-doa', '<p>Đại t&aacute; Quang 52 tuổi, qu&ecirc; ở huyện Trực Ninh, tỉnh Nam Định, nhiều năm c&ocirc;ng t&aacute;c tại c&ocirc;ng an tỉnh Lạng Sơn v&agrave; 7 năm l&agrave;m Ph&oacute; gi&aacute;m đốc c&ocirc;ng an tỉnh n&agrave;y trước khi lu&acirc;n chuyển sang l&agrave;m Gi&aacute;m đốc C&ocirc;ng an Cao Bằng. C&ugrave;ng ng&agrave;y, Bộ C&ocirc;ng an cũng điều động đại t&aacute; Th&aacute;i Hồng C&ocirc;ng (54 tuổi), qu&ecirc; qu&aacute;n huyện Đức Thọ, tỉnh H&agrave; Tĩnh, người từng c&oacute; 5 năm giữ chức Ph&oacute; gi&aacute;m đốc C&ocirc;ng an tỉnh Quảng Ninh l&agrave;m gi&aacute;m đốc C&ocirc;ng an tỉnh Lạng Sơn; Đại t&aacute; Dương Văn T&iacute;nh, Gi&aacute;m đốc C&ocirc;ng an tỉnh Bắc Kạn giữ chức Cục trưởng Cục C&ocirc;ng nghệ th&ocirc;ng tin, Bộ C&ocirc;ng an. C&aacute;c quyết định điều động, lu&acirc;n chuyển tr&ecirc;n c&oacute; hiệu lực từ ng&agrave;y 1/7. Kể từ đầu năm, Bộ C&ocirc;ng an đ&atilde; bổ nhiệm hơn 60 chức danh l&atilde;nh đạo c&aacute;c Cục v&agrave; c&ocirc;ng an tỉnh, th&agrave;nh. Trong cuối th&aacute;ng 6, Bộ C&ocirc;ng an bổ nhiệm hơn chục t&acirc;n gi&aacute;m đốc c&ocirc;ng an tỉnh v&agrave; nhiều Cục trưởng Cục nghiệp vụ. Việc bổ nhiệm, lu&acirc;n chuyển n&agrave;y để chuẩn bị nh&acirc;n sự cho Đại hội Đảng c&aacute;c cấp sắp diễn ra v&agrave; đảm bảo 100% c&aacute;n bộ l&atilde;nh đạo kh&ocirc;ng phải người địa phương.</p>', 'sdsdfsd', '2020-07-15 04:21:12', '2020-10-05 02:24:13', 'PUBLISHED'),
(4, 1, 1, 1, 'ntel. Đó mới là thông điệp thực sự của nhà Táo: thỏa thuận chỉ là tạm thời, Apple vẫn thừa ti', 'ntel-o-moi-la-thong-iep-thuc-su-cua-nha-tao-thoa-thuan-chi-la-tam-thoi-apple-van-thua-ti', '<p>Ng&agrave;y 27/6, Bộ C&ocirc;ng an điều động, bổ nhiệm t&acirc;n gi&aacute;m đốc C&ocirc;ng an tỉnh Lai Ch&acirc;u, Bắc Kạn, An Giang v&agrave; Long An. Đại t&aacute; Nguyễn Viết Giang trong buổi lễ nhận quyết định.Ảnh: C&ocirc;ng an Lai Ch&acirc;u Đại t&aacute; Nguyễn Viết Giang trong buổi lễ nhận quyết định ng&agrave;y 27/6. Ảnh: C&ocirc;ng an Lai Ch&acirc;u. Trung tướng Lương Tam Quang, Thứ trưởng C&ocirc;ng an trao quyết định điều động đại t&aacute; H&agrave; Văn Tuy&ecirc;n, Gi&aacute;m đốc C&ocirc;ng an tỉnh Lai Ch&acirc;u giữ chức Gi&aacute;m đốc C&ocirc;ng an tỉnh Bắc Kạn; đại t&aacute; Nguyễn Viết Giang, nguy&ecirc;n Ph&oacute; gi&aacute;m đốc C&ocirc;ng an tỉnh H&agrave; Giang đến nhận chức vụ Gi&aacute;m đốc C&ocirc;ng an tỉnh Lai Ch&acirc;u.</p>', 'sdsdfsd', '2020-07-15 04:21:12', '2020-10-05 02:24:00', 'PUBLISHED'),
(5, 1, 1, 1, 'chỉ nói "hài lòng" mà còn công bố luôn về thương vụ 1 tỷ USD để mua lại mảng phát triển chip 5', 'chi-noi-hai-long-ma-con-cong-bo-luon-ve-thuong-vu-1-ty-usd-e-mua-lai-mang-phat-trien-chip-5', '<p>Trong buổi lễ, Th&agrave;nh ủy H&agrave; Nội cũng chỉ định tướng Trung v&agrave;o Ban chấp h&agrave;nh, Ban Thường vụ, giữ chức B&iacute; thư Đảng ủy C&ocirc;ng an th&agrave;nh phố H&agrave; Nội. Thiếu tướng Nguyễn Hải Trung trong buổi lễ nhận quyết định bổ nhiệm của l&atilde;nh đạo Bộ C&ocirc;ng an. Ảnh: Lam Thanh. Thiếu tướng Nguyễn Hải Trung (phải) trong buổi lễ nhận quyết định bổ nhiệm của l&atilde;nh đạo Bộ C&ocirc;ng an s&aacute;ng 31/7. Ảnh: Sơn L&acirc;m. T&acirc;n gi&aacute;m đốc C&ocirc;ng an TP H&agrave; Nội 52 tuổi, qu&ecirc; Vĩnh Ph&uacute;c, từng đảm nhiệm c&aacute;c chức vụ như: Cục trưởng Tổ chức c&aacute;n bộ; Ph&oacute; tổng cục trưởng Tổng cục Ch&iacute;nh trị C&ocirc;ng an nh&acirc;n d&acirc;n, được phong h&agrave;m thiếu tướng năm 2018. Th&aacute;ng 8/2018, &ocirc;ng được điều động, bổ nhiệm giữ chức Gi&aacute;m đốc C&ocirc;ng an tỉnh Thanh H&oacute;a. Đến th&aacute;ng 6/2020, &ocirc;ng th&ocirc;i giữ chức vụ n&agrave;y v&agrave; được điều động l&agrave;m Ph&oacute; chủ nhiệm thường trực Ủy ban kiểm tra Đảng ủy C&ocirc;ng an Trung ương. Kể từ đầu th&aacute;ng 5 đến nay, Bộ C&ocirc;ng an bổ nhiệm h&agrave;ng chục chức danh l&atilde;nh đạo, trong đ&oacute; c&oacute; gần 10 gi&aacute;m đốc c&ocirc;ng an tỉnh v&agrave; gần 20 ph&oacute; gi&aacute;m đốc c&ocirc;ng an tỉnh c&ugrave;ng nhiều cục trưởng. Giải th&iacute;ch về việc bổ nhiệm, lu&acirc;n chuyển, l&atilde;nh đạo Bộ C&ocirc;ng an cho biết để chuẩn bị nh&acirc;n sự cho Đại hội Đảng c&aacute;c cấp, đảm bảo 100% c&aacute;n bộ, l&atilde;nh đạo kh&ocirc;ng phải l&agrave; người địa phương.</p>', 'sdsdfsd', '2020-07-15 04:21:12', '2020-10-05 02:22:43', 'PUBLISHED'),
(6, 1, 1, 1, 'thủ đã đặt chân vào thời đại 5G - và cũng là khi modem Intel thua đứt trước modem Qualcomm, hai bên mới tính đến chuyện dàn hòa vào đầu năm 2019. Nhưng trong lúc CEO của Qualc', 'thu-a-at-chan-vao-thoi-ai-5g-va-cung-la-khi-modem-intel-thua-ut-truoc-modem-qualcomm-hai-ben-moi-tinh-en-chuyen-dan-hoa-vao-au-nam-2019-nhung-trong-luc-ceo-cua-qualc', '<p>Nhiều năm c&ocirc;ng t&aacute;c tại C&ocirc;ng an Cao Bằng, đại t&aacute; H&agrave; Văn Tuy&ecirc;n từng giữ chức Trưởng Ph&ograve;ng Bảo vệ ch&iacute;nh trị, Trưởng C&ocirc;ng an huyện Tr&agrave; Lĩnh. Năm 2016, &ocirc;ng được bổ nhiệm l&agrave;m Ph&oacute; gi&aacute;m đốc C&ocirc;ng an tỉnh Cao Bằng, đến th&aacute;ng 1/2020 được điều động l&agrave;m gi&aacute;m đốc C&ocirc;ng an tỉnh Lai Ch&acirc;u cho đến nay. C&ugrave;ng ng&agrave;y 27/6, l&atilde;nh đạo Bộ C&ocirc;ng an cũng điều động, bổ nhiệm đại t&aacute; Đinh Văn Nơi, Ph&oacute; gi&aacute;m đốc C&ocirc;ng an TP Cần Thơ đến nhận c&ocirc;ng t&aacute;c v&agrave; giữ chức vụ Gi&aacute;m đốc C&ocirc;ng an tỉnh An Giang thay cho thiếu tướng B&ugrave;i B&eacute; Tư; đại t&aacute; L&acirc;m Minh Hồng, Ph&oacute; gi&aacute;m đốc C&ocirc;ng an tỉnh An Giang được điều động, bổ nhiệm giữ chức vụ Gi&aacute;m đốc C&ocirc;ng an tỉnh Long An, thay cho người tiền nhiệm l&agrave; đại t&aacute; L&ecirc; Hồng Nam được điều động l&agrave;m Gi&aacute;m đốc C&ocirc;ng an TP HCM. Một ng&agrave;y trước, l&atilde;nh đạo Bộ C&ocirc;ng an cũng bổ nhiệm gần chục t&acirc;n gi&aacute;m đốc c&ocirc;ng an tỉnh. Việc bổ nhiệm, lu&acirc;n chuyển h&agrave;ng loạt chức danh l&atilde;nh đạo chủ chốt ở C&ocirc;ng an c&aacute;c tỉnh l&agrave; để chuẩn bị nh&acirc;n sự cho Đại hội Đảng c&aacute;c cấp sắp diễn ra v&agrave; đảm bảo 100% c&aacute;n bộ, l&atilde;nh đạo kh&ocirc;ng phải l&agrave; người địa phương theo quy định. Kể từ đầu năm, Bộ C&ocirc;ng an đ&atilde; bổ nhiệm 60 chức danh l&atilde;nh đạo c&aacute;c Cục v&agrave; c&ocirc;ng an tỉnh. Theo Nghị định 01 th&aacute;ng 8/2018 về chức năng, quyền hạn, cơ cấu tổ chức bộ m&aacute;y Bộ C&ocirc;ng an, Bộ n&agrave;y đ&atilde; giảm 6 tổng cục; giảm 60 đơn vị cấp cục v&agrave; tương đương xuống c&ograve;n hơn 50 cục; giảm gần 300 đơn vị cấp ph&ograve;ng, 20 Sở Cảnh s&aacute;t ph&ograve;ng ch&aacute;y chữa ch&aacute;y được s&aacute;p nhập v&agrave;o c&ocirc;ng an tỉnh, th&agrave;nh phố. V&igrave; vậy, c&ocirc;ng an cấp tỉnh giảm hơn 500 đơn vị cấp ph&ograve;ng v&agrave; giảm 1.000 đơn vị ở cấp đội. Bộ C&ocirc;ng an cũng s&aacute;p nhập nhiều đơn vị tương đồng về chức năng, nhiệm vụ.</p>', 'sdsdfsd', '2020-07-15 04:21:12', '2020-10-05 02:22:29', 'PUBLISHED'),
(7, 1, 1, 1, 'rong cuộc chiến kéo dài từ iPhone X đến iPhone 11, Qualcomm không bán cho Apple bất kỳ một con chip modem nào cả - iPhone, iPad và các thiết bị Apple khác phải chuyển sang', 'rong-cuoc-chien-keo-dai-tu-iphone-x-en-iphone-11-qualcomm-khong-ban-cho-apple-bat-ky-mot-con-chip-modem-nao-ca-iphone-ipad-va-cac-thiet-bi-apple-khac-phai-chuyen-sang', '<p>Đại t&aacute; Quang 52 tuổi, qu&ecirc; ở huyện Trực Ninh, tỉnh Nam Định, nhiều năm c&ocirc;ng t&aacute;c tại c&ocirc;ng an tỉnh Lạng Sơn v&agrave; 7 năm l&agrave;m Ph&oacute; gi&aacute;m đốc c&ocirc;ng an tỉnh n&agrave;y trước khi lu&acirc;n chuyển sang l&agrave;m Gi&aacute;m đốc C&ocirc;ng an Cao Bằng. C&ugrave;ng ng&agrave;y, Bộ C&ocirc;ng an cũng điều động đại t&aacute; Th&aacute;i Hồng C&ocirc;ng (54 tuổi), qu&ecirc; qu&aacute;n huyện Đức Thọ, tỉnh H&agrave; Tĩnh, người từng c&oacute; 5 năm giữ chức Ph&oacute; gi&aacute;m đốc C&ocirc;ng an tỉnh Quảng Ninh l&agrave;m gi&aacute;m đốc C&ocirc;ng an tỉnh Lạng Sơn; Đại t&aacute; Dương Văn T&iacute;nh, Gi&aacute;m đốc C&ocirc;ng an tỉnh Bắc Kạn giữ chức Cục trưởng Cục C&ocirc;ng nghệ th&ocirc;ng tin, Bộ C&ocirc;ng an. C&aacute;c quyết định điều động, lu&acirc;n chuyển tr&ecirc;n c&oacute; hiệu lực từ ng&agrave;y 1/7. Kể từ đầu năm, Bộ C&ocirc;ng an đ&atilde; bổ nhiệm hơn 60 chức danh l&atilde;nh đạo c&aacute;c Cục v&agrave; c&ocirc;ng an tỉnh, th&agrave;nh. Trong cuối th&aacute;ng 6, Bộ C&ocirc;ng an bổ nhiệm hơn chục t&acirc;n gi&aacute;m đốc c&ocirc;ng an tỉnh v&agrave; nhiều Cục trưởng Cục nghiệp vụ. Việc bổ nhiệm, lu&acirc;n chuyển n&agrave;y để chuẩn bị nh&acirc;n sự cho Đại hội Đảng c&aacute;c cấp sắp diễn ra v&agrave; đảm bảo 100% c&aacute;n bộ l&atilde;nh đạo kh&ocirc;ng phải người địa phương.</p>', 'sdsdfsd', '2020-07-15 04:21:12', '2020-10-05 02:22:18', 'PUBLISHED'),
(8, 1, 1, 1, 'i dung, Apple tạo ra cơ hội mới không chỉ cho chúng tôi, mà cho cả các nghệ sĩ, những người sáng tạ', 'i-dung-apple-tao-ra-co-hoi-moi-khong-chi-cho-chung-toi-ma-cho-ca-cac-nghe-si-nhung-nguoi-sang-ta', '<p>Đội phản ứng nhanh của Trung t&acirc;m Y tế quận Cầu Giấy đ&atilde; khoanh v&ugrave;ng v&agrave; phun khử khuẩn tại nh&agrave; h&agrave;ng số 106 Trần Th&aacute;i T&ocirc;ng, l&uacute;c 9h30 s&aacute;ng 29/7. Nh&acirc;n vi&ecirc;n y tế phun khử khuẩn nh&agrave; h&agrave;ng số 106, Trần Th&aacute;i T&ocirc;ng. Ảnh: Tất Định Nh&acirc;n vi&ecirc;n y tế phun khử khuẩn nh&agrave; h&agrave;ng số 106, Trần Th&aacute;i T&ocirc;ng. Ảnh: Tất Định &Ocirc;ng B&ugrave;i Tuấn Anh, Chủ tịch UBND quận Cầu Giấy, cho biết s&aacute;ng nay quận nhận được th&ocirc;ng tin về một ca nghi nhiễm Covid-19 l&agrave; nh&acirc;n vi&ecirc;n của nh&agrave; h&agrave;ng pizza tại 106 Trần Th&aacute;i T&ocirc;ng. Quận Cầu Giấy đ&atilde; điều động đội phản ứng nhanh của Trung t&acirc;m Y tế phun khử khuẩn khu vực nh&agrave; h&agrave;ng, r&agrave; so&aacute;t l&ecirc;n danh s&aacute;ch người tiếp x&uacute;c gần với ca nghi nhiễm. C&ocirc;ng an căng d&acirc;y khoảng 30 m quanh nh&agrave; h&agrave;ng; khoảng 10 nh&acirc;n vi&ecirc;n của cơ sở n&agrave;y được y&ecirc;u cầu đeo khẩu trang v&agrave; kh&ocirc;ng ra ngo&agrave;i.</p>', 'sdsdfsd', '2020-07-15 04:21:12', '2020-10-05 02:22:05', 'PUBLISHED'),
(9, 1, 1, 1, 'thế giới đơn giản là chỉ muốn tận hưởng đầy đủ các lợi thế về cộng đồng người dùng, các cô', 'the-gioi-on-gian-la-chi-muon-tan-huong-ay-u-cac-loi-the-ve-cong-ong-nguoi-dung-cac-co', '<p>L&uacute;c 11h30, lực lượng chức năng vẫn phun khử khuẩn ph&iacute;a trong nh&agrave; h&agrave;ng số 106 Trần Th&aacute;i T&ocirc;ng v&agrave; lấy mẫu bệnh phẩm c&aacute;c nh&acirc;n vi&ecirc;n để x&eacute;t nghiệm. Xe cứu thương của Trung t&acirc;m Y tế quận Cầu Giấy đỗ trước cửa nh&agrave; h&agrave;ng. Ph&iacute;a ngo&agrave;i h&agrave;ng r&agrave;o khoanh v&ugrave;ng c&oacute; hai c&ocirc;ng an đứng điều tiết giao th&ocirc;ng v&agrave; nhắc nhở mọi người kh&ocirc;ng v&agrave;o khu vực căng d&acirc;y. Một cơ sở kinh doanh b&ecirc;n cạnh nh&agrave; h&agrave;ng n&agrave;y đ&atilde; đ&oacute;ng cửa, song một số cơ sở gần đ&oacute; vẫn đ&oacute;n kh&aacute;ch ra v&agrave;o, mọi người đều đeo khẩu trang Theo nguồn tin, người nghi nhiễm l&agrave; nam, 23 tuổi, tr&uacute; tại Mễ Tr&igrave;, Nam Từ Li&ecirc;m, nh&acirc;n vi&ecirc;n tại cửa h&agrave;ng 106 Trần Th&aacute;i T&ocirc;ng; từng đi du lịch Đ&agrave; Nẵng trong thời gian gần đ&acirc;y. Cũng trong s&aacute;ng nay, c&ocirc;ng an phường Mễ Tr&igrave; dựng r&agrave;o chắn một đoạn ng&otilde; 230 Mễ Tr&igrave; Thượng, nơi ca nghi nhiễm cư tr&uacute;, hạn chế người d&acirc;n ra v&agrave;o. Trung t&acirc;m Y tế quận Nam Từ Li&ecirc;m phun khử khuẩn ở quanh khu vực. C&ocirc;ng an phường Mễ Tr&igrave; dựng r&agrave;o chắn ở một đoạn ng&otilde; 230 Mễ Tr&igrave; Thượng. Ảnh: Tất Định C&ocirc;ng an phường Mễ Tr&igrave; dựng r&agrave;o chắn ở một đoạn ng&otilde; 230 Mễ Tr&igrave; Thượng. Ảnh: Tất Định Đến s&aacute;ng 29/7, H&agrave; Nội đ&atilde; qua 107 ng&agrave;y kh&ocirc;ng ph&aacute;t hiện ca bệnh mới ngo&agrave;i cộng đồng. Tuy nhi&ecirc;n, tại cuộc họp Ban chỉ đạo ph&ograve;ng, chống dịch h&ocirc;m 27/7, Chủ tịch th&agrave;nh phố Nguyễn Đức Chung n&oacute;i H&agrave; Nội c&oacute; nguy cơ l&acirc;y nhiễm cao do số lượng người từ Đ&agrave; Nẵng về rất đ&ocirc;ng, khoảng 15.000 đến 20.000 người.</p>', 'sdsdfsd', '2020-07-15 04:21:12', '2020-10-05 02:21:53', 'PUBLISHED'),
