(11, 1, 1, 4, 'dọa loại bỏ tính năng đăng nhập Fortnite, Epic vội vã "la làng". Nhưng ít ngày sau, nhà Táo thủng thẳng tuyên bố với The Verge và Fox Business: đâu phải đâu, Apple chẳng hề có ý địn', 'doa-loai-bo-tinh-nang-ang-nhap-fortnite-epic-voi-va-la-lang-nhung-it-ngay-sau-nha-tao-thung-thang-tuyen-bo-voi-the-verge-va-fox-business-au-phai-au-apple-chang-he-co-y-in', '<p>L&uacute;c 11h30, lực lượng chức năng vẫn phun khử khuẩn ph&iacute;a trong nh&agrave; h&agrave;ng số 106 Trần Th&aacute;i T&ocirc;ng v&agrave; lấy mẫu bệnh phẩm c&aacute;c nh&acirc;n vi&ecirc;n để x&eacute;t nghiệm. Xe cứu thương của Trung t&acirc;m Y tế quận Cầu Giấy đỗ trước cửa nh&agrave; h&agrave;ng. Ph&iacute;a ngo&agrave;i h&agrave;ng r&agrave;o khoanh v&ugrave;ng c&oacute; hai c&ocirc;ng an đứng điều tiết giao th&ocirc;ng v&agrave; nhắc nhở mọi người kh&ocirc;ng v&agrave;o khu vực căng d&acirc;y. Một cơ sở kinh doanh b&ecirc;n cạnh nh&agrave; h&agrave;ng n&agrave;y đ&atilde; đ&oacute;ng cửa, song một số cơ sở gần đ&oacute; vẫn đ&oacute;n kh&aacute;ch ra v&agrave;o, mọi người đều đeo khẩu trang Theo nguồn tin, người nghi nhiễm l&agrave; nam, 23 tuổi, tr&uacute; tại Mễ Tr&igrave;, Nam Từ Li&ecirc;m, nh&acirc;n vi&ecirc;n tại cửa h&agrave;ng 106 Trần Th&aacute;i T&ocirc;ng; từng đi du lịch Đ&agrave; Nẵng trong thời gian gần đ&acirc;y. Cũng trong s&aacute;ng nay, c&ocirc;ng an phường Mễ Tr&igrave; dựng r&agrave;o chắn một đoạn ng&otilde; 230 Mễ Tr&igrave; Thượng, nơi ca nghi nhiễm cư tr&uacute;, hạn chế người d&acirc;n ra v&agrave;o. Trung t&acirc;m Y tế quận Nam Từ Li&ecirc;m phun khử khuẩn ở quanh khu vực. C&ocirc;ng an phường Mễ Tr&igrave; dựng r&agrave;o chắn ở một đoạn ng&otilde; 230 Mễ Tr&igrave; Thượng. Ảnh: Tất Định C&ocirc;ng an phường Mễ Tr&igrave; dựng r&agrave;o chắn ở một đoạn ng&otilde; 230 Mễ Tr&igrave; Thượng. Ảnh: Tất Định Đến s&aacute;ng 29/7, H&agrave; Nội đ&atilde; qua 107 ng&agrave;y kh&ocirc;ng ph&aacute;t hiện ca bệnh mới ngo&agrave;i cộng đồng. Tuy nhi&ecirc;n, tại cuộc họp Ban chỉ đạo ph&ograve;ng, chống dịch h&ocirc;m 27/7, Chủ tịch th&agrave;nh phố Nguyễn Đức Chung n&oacute;i H&agrave; Nội c&oacute; nguy cơ l&acirc;y nhiễm cao do số lượng người từ Đ&agrave; Nẵng về rất đ&ocirc;ng, khoảng 15.000 đến 20.000 người.</p>', 'sdsdfsd', '2020-07-15 04:21:12', '2020-10-05 02:21:23', 'PUBLISHED'),
(12, 1, 1, 3, 'phép Apple thực hiện động thái trên, rõ ràng là Tim Cook chẳng cần tung đòn mà đối thủ đã đau: theo khẳng định từ chính Epic, nhiều nhà phát triển đã từ bỏ Unreal Engine vì e ngại về tương lai bấp', 'phep-apple-thuc-hien-ong-thai-tren-ro-rang-la-tim-cook-chang-can-tung-on-ma-oi-thu-a-au-theo-khang-inh-tu-chinh-epic-nhieu-nha-phat-trien-a-tu-bo-unreal-engine-vi-e-ngai-ve-tuong-lai-bap', '<p>Đại t&aacute; Vũ Hồng Quang l&agrave;m Gi&aacute;m đốc C&ocirc;ng an Cao Bằng, đại t&aacute; Th&aacute;i Hồng C&ocirc;ng được lu&acirc;n chuyển l&agrave;m gi&aacute;m đốc C&ocirc;ng an Lạng Sơn. Đại t&aacute; Th&aacute;i Hồng C&ocirc;ng nhận quyết định bổ nhiệm. Ảnh: Bộ C&ocirc;ng an Đại t&aacute; Th&aacute;i Hồng C&ocirc;ng nhận quyết định bổ nhiệm. Ảnh: Bộ C&ocirc;ng an Ng&agrave;y 30/6, l&atilde;nh đạo Bộ C&ocirc;ng an đ&atilde; trao quyết định bổ nhiệm, điều động Đại t&aacute; Vũ Hồng Quang, Ph&oacute; gi&aacute;m đốc c&ocirc;ng an tỉnh Lạng Sơn đến nhận c&ocirc;ng t&aacute;c v&agrave; giữ chức vụ Gi&aacute;m đốc C&ocirc;ng an tỉnh Cao Bằng thay cho người tiền nhiệm l&agrave; Thiếu tướng Nguyễn Ngọc To&agrave;n - đ&atilde; được điều động giữ chức Cục trưởng Cục c&ocirc;ng t&aacute;c đảng v&agrave; c&ocirc;ng t&aacute;c ch&iacute;nh trị (Bộ C&ocirc;ng an).</p>', 'sdsdfsd', '2020-07-15 04:21:12', '2020-10-05 02:21:11', 'PUBLISHED'),
(13, 1, 1, 1, 'ên bản iOS, qua mặt khoản phí 30% của App Store. Ngay lập tức, Apple đã xóa Fortnite khỏi chợ ứng dụn', 'en-ban-ios-qua-mat-khoan-phi-30-cua-app-store-ngay-lap-tuc-apple-a-xoa-fortnite-khoi-cho-ung-dun', '<p>Trong buổi lễ, Th&agrave;nh ủy H&agrave; Nội cũng chỉ định tướng Trung v&agrave;o Ban chấp h&agrave;nh, Ban Thường vụ, giữ chức B&iacute; thư Đảng ủy C&ocirc;ng an th&agrave;nh phố H&agrave; Nội. Thiếu tướng Nguyễn Hải Trung trong buổi lễ nhận quyết định bổ nhiệm của l&atilde;nh đạo Bộ C&ocirc;ng an. Ảnh: Lam Thanh. Thiếu tướng Nguyễn Hải Trung (phải) trong buổi lễ nhận quyết định bổ nhiệm của l&atilde;nh đạo Bộ C&ocirc;ng an s&aacute;ng 31/7. Ảnh: Sơn L&acirc;m. T&acirc;n gi&aacute;m đốc C&ocirc;ng an TP H&agrave; Nội 52 tuổi, qu&ecirc; Vĩnh Ph&uacute;c, từng đảm nhiệm c&aacute;c chức vụ như: Cục trưởng Tổ chức c&aacute;n bộ; Ph&oacute; tổng cục trưởng Tổng cục Ch&iacute;nh trị C&ocirc;ng an nh&acirc;n d&acirc;n, được phong h&agrave;m thiếu tướng năm 2018. Th&aacute;ng 8/2018, &ocirc;ng được điều động, bổ nhiệm giữ chức Gi&aacute;m đốc C&ocirc;ng an tỉnh Thanh H&oacute;a. Đến th&aacute;ng 6/2020, &ocirc;ng th&ocirc;i giữ chức vụ n&agrave;y v&agrave; được điều động l&agrave;m Ph&oacute; chủ nhiệm thường trực Ủy ban kiểm tra Đảng ủy C&ocirc;ng an Trung ương. Kể từ đầu th&aacute;ng 5 đến nay, Bộ C&ocirc;ng an bổ nhiệm h&agrave;ng chục chức danh l&atilde;nh đạo, trong đ&oacute; c&oacute; gần 10 gi&aacute;m đốc c&ocirc;ng an tỉnh v&agrave; gần 20 ph&oacute; gi&aacute;m đốc c&ocirc;ng an tỉnh c&ugrave;ng nhiều cục trưởng. Giải th&iacute;ch về việc bổ nhiệm, lu&acirc;n chuyển, l&atilde;nh đạo Bộ C&ocirc;ng an cho biết để chuẩn bị nh&acirc;n sự cho Đại hội Đảng c&aacute;c cấp, đảm bảo 100% c&aacute;n bộ, l&atilde;nh đạo kh&ocirc;ng phải l&agrave; người địa phương.</p>', 'sdsdfsd', '2020-07-15 04:21:12', '2020-10-05 02:20:54', 'PUBLISHED'),
(14, 1, 1, 1, 'c là kẻ đầu tiên trong lịch sử dám cố tình thách thức Apple bằng cách đưa phương thức thanh toán riêng vào Fo', 'c-la-ke-au-tien-trong-lich-su-dam-co-tinh-thach-thuc-apple-bang-cach-ua-phuong-thuc-thanh-toan-rieng-vao-fo', '<p>L&uacute;c 11h30, lực lượng chức năng vẫn phun khử khuẩn ph&iacute;a trong nh&agrave; h&agrave;ng số 106 Trần Th&aacute;i T&ocirc;ng v&agrave; lấy mẫu bệnh phẩm c&aacute;c nh&acirc;n vi&ecirc;n để x&eacute;t nghiệm. Xe cứu thương của Trung t&acirc;m Y tế quận Cầu Giấy đỗ trước cửa nh&agrave; h&agrave;ng. Ph&iacute;a ngo&agrave;i h&agrave;ng r&agrave;o khoanh v&ugrave;ng c&oacute; hai c&ocirc;ng an đứng điều tiết giao th&ocirc;ng v&agrave; nhắc nhở mọi người kh&ocirc;ng v&agrave;o khu vực căng d&acirc;y. Một cơ sở kinh doanh b&ecirc;n cạnh nh&agrave; h&agrave;ng n&agrave;y đ&atilde; đ&oacute;ng cửa, song một số cơ sở gần đ&oacute; vẫn đ&oacute;n kh&aacute;ch ra v&agrave;o, mọi người đều đeo khẩu trang Theo nguồn tin, người nghi nhiễm l&agrave; nam, 23 tuổi, tr&uacute; tại Mễ Tr&igrave;, Nam Từ Li&ecirc;m, nh&acirc;n vi&ecirc;n tại cửa h&agrave;ng 106 Trần Th&aacute;i T&ocirc;ng; từng đi du lịch Đ&agrave; Nẵng trong thời gian gần đ&acirc;y. Cũng trong s&aacute;ng nay, c&ocirc;ng an phường Mễ Tr&igrave; dựng r&agrave;o chắn một đoạn ng&otilde; 230 Mễ Tr&igrave; Thượng, nơi ca nghi nhiễm cư tr&uacute;, hạn chế người d&acirc;n ra v&agrave;o. Trung t&acirc;m Y tế quận Nam Từ Li&ecirc;m phun khử khuẩn ở quanh khu vực. C&ocirc;ng an phường Mễ Tr&igrave; dựng r&agrave;o chắn ở một đoạn ng&otilde; 230 Mễ Tr&igrave; Thượng. Ảnh: Tất Định C&ocirc;ng an phường Mễ Tr&igrave; dựng r&agrave;o chắn ở một đoạn ng&otilde; 230 Mễ Tr&igrave; Thượng. Ảnh: Tất Định Đến s&aacute;ng 29/7, H&agrave; Nội đ&atilde; qua 107 ng&agrave;y kh&ocirc;ng ph&aacute;t hiện ca bệnh mới ngo&agrave;i cộng đồng. Tuy nhi&ecirc;n, tại cuộc họp Ban chỉ đạo ph&ograve;ng, chống dịch h&ocirc;m 27/7, Chủ tịch th&agrave;nh phố Nguyễn Đức Chung n&oacute;i H&agrave; Nội c&oacute; nguy cơ l&acirc;y nhiễm cao do số lượng người từ Đ&agrave; Nẵng về rất đ&ocirc;ng, khoảng 15.000 đến 20.000 người.</p>', 'tags', '2020-07-15 04:21:12', '2020-10-05 02:20:41', 'PUBLISHED'),
(15, 1, 1, 2, 'Quả là không có cách nào để nhắc khéo Facebook hơn rằng, đến cuối cùng, mạng xã hội số 1 hành tinh vẫn chỉ là khách trên nền tảng di động có doanh thu cao nhất thế giới.', 'qua-la-khong-co-cach-nao-e-nhac-kheo-facebook-hon-rang-en-cuoi-cung-mang-xa-hoi-so-1-hanh-tinh-van-chi-la-khach-tren-nen-tang-di-ong-co-doanh-thu-cao-nhat-the-gioi', '<p>Đại t&aacute; Vũ Hồng Quang l&agrave;m Gi&aacute;m đốc C&ocirc;ng an Cao Bằng, đại t&aacute; Th&aacute;i Hồng C&ocirc;ng được lu&acirc;n chuyển l&agrave;m gi&aacute;m đốc C&ocirc;ng an Lạng Sơn. Đại t&aacute; Th&aacute;i Hồng C&ocirc;ng nhận quyết định bổ nhiệm. Ảnh: Bộ C&ocirc;ng an Đại t&aacute; Th&aacute;i Hồng C&ocirc;ng nhận quyết định bổ nhiệm. Ảnh: Bộ C&ocirc;ng an Ng&agrave;y 30/6, l&atilde;nh đạo Bộ C&ocirc;ng an đ&atilde; trao quyết định bổ nhiệm, điều động Đại t&aacute; Vũ Hồng Quang, Ph&oacute; gi&aacute;m đốc c&ocirc;ng an tỉnh Lạng Sơn đến nhận c&ocirc;ng t&aacute;c v&agrave; giữ chức vụ Gi&aacute;m đốc C&ocirc;ng an tỉnh Cao Bằng thay cho người tiền nhiệm l&agrave; Thiếu tướng Nguyễn Ngọc To&agrave;n - đ&atilde; được điều động giữ chức Cục trưởng Cục c&ocirc;ng t&aacute;c đảng v&agrave; c&ocirc;ng t&aacute;c ch&iacute;nh trị (Bộ C&ocirc;ng an).</p>', 'sdfsdfsd sdfsfdfs', '2020-07-15 04:24:21', '2020-10-05 02:24:39', 'PUBLISHED'),
(16, 1, 1, 1, 'iPhone trở thành tâm điểm của vụ kiện giữa FBI và Apple. Theo Cơ quan Điều tra Liên bang Hoa Kỳ', 'iphone-tro-thanh-tam-iem-cua-vu-kien-giua-fbi-va-apple-theo-co-quan-ieu-tra-lien-bang-hoa-ky', '<p>Năm 2016, một chiếc iPhone trở th&agrave;nh t&acirc;m điểm của vụ kiện giữa FBI v&agrave; Apple. Theo Cơ quan Điều tra Li&ecirc;n bang Hoa Kỳ, Apple cần phải tạo ra c&ocirc;ng cụ mở kh&oacute;a (backdoor) cho chiếc iPhone của t&ecirc;n khủng bố tại San Berdino.</p>\r\n\r\n<p>Apple ki&ecirc;n quyết n&oacute;i kh&ocirc;ng v&igrave; cho rằng một c&ocirc;ng cụ như vậy c&oacute; thể bị lộ ra ngo&agrave;i v&agrave; lạm dụng cho c&aacute;c mục đ&iacute;ch xấu. FBI đưa Apple ra t&ograve;a v&agrave; ngay lập tức nhận lời chỉ tr&iacute;ch &quot;kh&ocirc;ng cẩn thận&quot;, &quot;k&eacute;m hiểu biết&quot;:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a class="detail-img-lightbox" href="https://genk.mediacdn.vn/139269124445442048/2020/10/2/layer-12-16016276729161284849961.png" style="color: rgb(229, 44, 75);" target="_blank" title=""><img alt="Điểm danh những nạn nhân đã từng nếm độ mặn của Apple: Epic, Spotify, Qualcomm, Facebook và FBI - Ảnh 12." class="lightbox-content" id="img_236406385940869120" src="https://genk.mediacdn.vn/139269124445442048/2020/10/2/layer-12-16016276729161284849961.png" style="max-width:100%" title="Điểm danh những nạn nhân đã từng nếm độ mặn của Apple: Epic, Spotify, Qualcomm, Facebook và FBI - Ảnh 12." /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sau đ&oacute;, vụ kiện đ&atilde; bị r&uacute;t lại khi FBI thu&ecirc; được một c&ocirc;ng ty Israel để hack chiếc iPhone n&oacute;i tr&ecirc;n. Mong ước thực sự của FBI về một c&ocirc;ng cụ mở kh&oacute;a &quot;bất khả chiến bại&quot; (v&igrave; được ch&iacute;nh Apple tạo ra) vẫn chưa th&agrave;nh hiện thực.&nbsp;</p>', 'aaa', '2020-08-17 08:56:25', '2020-10-05 02:25:35', 'PUBLISHED'),
(17, 1, 1, 1, 'Galaxy Z Fold 2 đã vượt qua được bài kiểm tra bụi bẩn mà bản tiền nhiệm đã phải bó tay', 'galaxy-z-fold-2-a-vuot-qua-uoc-bai-kiem-tra-bui-ban-ma-ban-tien-nhiem-a-phai-bo-tay', '<p>Mặc d&ugrave; vậy m&agrave;n h&igrave;nh gập của Galaxy Z Fold 2 vẫn kh&aacute; mỏng manh v&agrave; rất dễ xước.</p>\r\n\r\n<p>Anh ch&agrave;ng Zack Nelson đến từ k&ecirc;nh YouTube JerryRigEverything được biết tới l&agrave; người chuy&ecirc;n thẩm định độ bền của c&aacute;c thiết bị di động v&agrave; đem tới một g&oacute;c nh&igrave;n kh&aacute;c về sản phẩm tới c&ocirc;ng ch&uacute;ng.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="Galaxy Z Fold 2 đã vượt qua được bài kiểm tra bụi bẩn mà bản tiền nhiệm đã phải bó tay - Ảnh 1." id="img_236742300639334400" src="https://genk.mediacdn.vn/thumb_w/660/139269124445442048/2020/10/3/2020-10-03134041-16017077615371824795801.jpg" style="max-width:100%" title="Galaxy Z Fold 2 đã vượt qua được bài kiểm tra bụi bẩn mà bản tiền nhiệm đã phải bó tay - Ảnh 1." /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mới đ&acirc;y anh ch&agrave;ng n&agrave;y vừa tiếp tục &quot;tra tấn&quot; Galaxy Z Fold 2. Phi&ecirc;n bản n&acirc;ng cấp mới của Galaxy Fold được khẳng định c&oacute; bản lề chắc chắn v&agrave; kh&aacute;ng bụi bẩn tốt hơn. V&agrave; thử nghiệm của Zack đ&atilde; chứng minh tuy&ecirc;n bố tr&ecirc;n của Samsung l&agrave; đ&uacute;ng.</p>\r\n\r\n<p>Thử nghiệm ban đầu của Zack cho thấy, d&ugrave; đổ bụi bẩn v&agrave;o trong phần bản lề nhưng cảm gi&aacute;c đ&oacute;ng mở vẫn rất &ecirc;m &aacute;i v&agrave; như chưa hề c&oacute; vấn đề g&igrave; xảy ra. Điều n&agrave;y phần n&agrave;o khẳng định cơ chế chống bụi của bản lề đ&atilde; được cải tiến.</p>', 'vvvvvvvv', '2020-08-22 08:58:59', '2020-10-05 02:26:10', 'PUBLISHED'),
(18, 1, 1, 1, 'Lộ toàn bộ giá dòng iPhone 12 mới, mức giá thấp nhất sẽ khiến Samsung phải lo ngại', 'lo-toan-bo-gia-dong-iphone-12-moi-muc-gia-thap-nhat-se-khien-samsung-phai-lo-ngai', '<p>D&ograve;ng iPhone 12 Mini với k&iacute;ch thước m&agrave;n h&igrave;nh nhỏ nhất 5,4 inch đ&atilde; thay thế iPhone 12 trở th&agrave;nh thiết bị c&oacute; gi&aacute; thấp nhất trong lần ra mắt với mức gi&aacute; khởi điểm chỉ 649 USD. Trong khi đ&oacute;, d&ograve;ng iPhone 12 ti&ecirc;u chuẩn với m&agrave;n h&igrave;nh tương tự iPhone 11 v&agrave; XR trước đ&acirc;y c&oacute; gi&aacute; khởi điểm cao hơn một ch&uacute;t, từ 749 USD trở l&ecirc;n.</p>\r\n\r\n<p>Theo c&aacute;c tin đồn trước đ&acirc;y, cả iPhone 12 Mini v&agrave; iPhone 12 thường đều được trang bị m&agrave;n h&igrave;nh OLED, camera k&eacute;p c&ugrave;ng chip A14 Bionic đời mới. V&igrave; vậy mức gi&aacute; n&agrave;y được xem l&agrave; kh&aacute; hợp l&yacute;. Năm ngo&aacute;i iPhone 11, thiết bị rẻ nhất trong loạt iPhone mới, ra mắt với mức gi&aacute; 699 USD, nhưng chỉ sử dụng m&agrave;n h&igrave;nh LCD với độ ph&acirc;n giải thấp hơn.</p>\r\n\r\n<p>Mặc d&ugrave; vậy, mức gi&aacute; n&agrave;y cũng c&oacute; thể khiến người d&ugrave;ng lăn tăn khi so s&aacute;nh với c&aacute;c đối thủ trong thế giới Android.</p>\r\n\r\n<p>Google Pixel 5 mới ra mắt v&agrave;i ng&agrave;y trước với mức gi&aacute; 699 USD c&ugrave;ng c&ugrave;ng camera k&eacute;p v&agrave; m&agrave;n h&igrave;nh OLED k&iacute;ch thước lớn hơn, nhưng chỉ c&oacute; bộ xử l&yacute; Snapdragon 765G chậm hơn. Ngo&agrave;i ra c&ograve;n c&oacute; Samsung Galaxy S20 FE với nhiều th&ocirc;ng số ấn tượng như m&agrave;n h&igrave;nh 120Hz, cụm 3 camera v&agrave; bộ xử l&yacute; Snapdragon 865 mạnh mẽ c&ugrave;ng m&agrave;n h&igrave;nh lớn nhưng mức gi&aacute; khởi điểm chỉ 699 USD.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a class="detail-img-lightbox" href="https://genk.mediacdn.vn/139269124445442048/2020/10/3/gsmarena000-1601701374921461615265.jpg" style="color: rgb(84, 84, 84);" target="_blank" title=""><img alt="Lộ toàn bộ giá dòng iPhone 12 mới, mức giá thấp nhất sẽ khiến Samsung phải lo ngại - Ảnh 2." class="lightbox-content" id="img_236715506733326336" src="https://genk.mediacdn.vn/thumb_w/660/139269124445442048/2020/10/3/gsmarena000-1601701374921461615265.jpg" style="max-width:100%" title="Lộ toàn bộ giá dòng iPhone 12 mới, mức giá thấp nhất sẽ khiến Samsung phải lo ngại - Ảnh 2." /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Mức gi&aacute; iPhone 12 Pro</strong></p>\r\n\r\n<p>Mặc d&ugrave; mức gi&aacute; khởi điểm d&ograve;ng iPhone 12 Pro vẫn tương tự như iPhone 11 Pro, nhưng ch&uacute;ng đ&atilde; được cải thiện về k&iacute;ch thước m&agrave;n h&igrave;nh v&agrave; dung lượng bộ nhớ lưu trữ. C&ugrave;ng c&oacute; gi&aacute; khởi điểm 999 USD, iPhone 12 Pro c&oacute; dung lượng 128GB, gấp đ&ocirc;i iPhone 11 Pro v&agrave; m&agrave;n h&igrave;nh 6,1 inch, lớn hơn so với m&agrave;n h&igrave;nh 5,8 inch trước đ&acirc;y.</p>\r\n\r\n<p>Tương tự, d&ograve;ng iPhone 12 Pro Max cũng c&oacute; gi&aacute; khởi điểm 1.099 USD, tương tự iPhone 11 Pro Max nhưng lại c&oacute; dung lượng gấp đ&ocirc;i, 128GB c&ugrave;ng m&agrave;n h&igrave;nh 6,7 inch, lớn hơn một ch&uacute;t so với thế hệ tiền nhiệm.</p>', 'sdfsdfsd', '2020-08-18 02:43:37', '2020-10-03 18:39:25', 'PUBLISHED'),
(20, 1, 1, 6, 'thiết bị có thể chống thấm nước hoặc chống bụi hoàn toàn nhưng thử nghiệm này cho thấy, điện thoại đã thể hiện rất', 'thiet-bi-co-the-chong-tham-nuoc-hoac-chong-bui-hoan-toan-nhung-thu-nghiem-nay-cho-thay-ien-thoai-a-the-hien-rat', '<p>Cụ thể Samsung đ&atilde; sử dụng c&ocirc;ng nghệ &quot;qu&eacute;t bụi&quot; tr&ecirc;n m&aacute;y tương tự như Galaxy Z Flip. C&ocirc;ng nghệ n&agrave;y cho ph&eacute;p qu&eacute;t bụi bẩn ra khỏi m&agrave;n h&igrave;nh ngay lập tức. D&ugrave; Samsung kh&ocirc;ng tuy&ecirc;n bố thiết bị c&oacute; thể chống thấm nước hoặc chống bụi ho&agrave;n to&agrave;n nhưng thử nghiệm n&agrave;y cho thấy, điện thoại đ&atilde; thể hiện rất tốt.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="Galaxy Z Fold 2 đã vượt qua được bài kiểm tra bụi bẩn mà bản tiền nhiệm đã phải bó tay - Ảnh 2." id="img_236742299498033152" src="https://genk.mediacdn.vn/thumb_w/660/139269124445442048/2020/10/3/2020-10-03134347-1601707761666812832277.jpg" style="max-width:100%" title="Galaxy Z Fold 2 đã vượt qua được bài kiểm tra bụi bẩn mà bản tiền nhiệm đã phải bó tay - Ảnh 2." /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Jack Nelson kh&ocirc;ng th&aacute;o rời điện thoại để kiểm tra v&igrave; vậy kh&ocirc;ng r&otilde; liệu c&oacute; bất kỳ mảnh bụi bẩn nhỏ hơn n&agrave;o c&oacute; thể lọt v&agrave;o bản lề hay kh&ocirc;ng, mặc d&ugrave; m&agrave;n mổ bụng trước đ&oacute; của iFixit với Galaxy Z Flip cho thấy, bụi nhỏ c&oacute; thể lọt qua những sợi l&ocirc;ng trong cơ chế bản lề.</p>\r\n\r\n<p>Tuy c&oacute; cơ chế bản lề tốt hơn nhưng m&agrave;n h&igrave;nh của Galaxy Z Fold 2 nh&igrave;n chung vẫn kh&aacute; dễ xước như Galaxy Z Flip với chỉ một t&aacute;c động bằng m&oacute;ng tay. Thử nghiệm c&agrave;o xước cho thấy, m&agrave;n h&igrave;nh b&ecirc;n trong bị xước ngay từ mốc 2 trong thang đo độ cứng Mohs. Nhưng m&agrave;n h&igrave;nh phụ b&ecirc;n ngo&agrave;i nhờ trang bị k&iacute;nh cường lực mới n&ecirc;n chỉ bị xước từ mốc 6.</p>', 'aaaa', '2020-09-17 11:22:36', '2020-10-05 02:26:31', 'PUBLISHED'),
(21, 1, 1, 6, 'Tới bài kiểm tra hơ lửa, cả hai màn hình chính và phụ của máy gần như không gặp vấn đề gì khi màn hình có thể tự hồi sau khi bị hơ lửa.', 'toi-bai-kiem-tra-ho-lua-ca-hai-man-hinh-chinh-va-phu-cua-may-gan-nhu-khong-gap-van-e-gi-khi-man-hinh-co-the-tu-hoi-sau-khi-bi-ho-lua', '<p>Galaxy Z Fold 2 sử dụng c&ocirc;ng nghệ k&iacute;nh si&ecirc;u mỏng của Samsung nhưng n&oacute; vẫn được bao phủ bởi một lớp nhựa dễ trầy xước ở b&ecirc;n tr&ecirc;n. Nếu m&agrave;n h&igrave;nh bị vỡ trong năm đầu, Samsung c&oacute; cung cấp dịch vụ thay thế với gi&aacute; 149 USD.</p>\r\n\r\n<p>Về phần khung m&aacute;y do l&agrave;m từ kim loại n&ecirc;n cũng kh&aacute; dễ bị c&agrave;o xước với lực t&aacute;c động mạnh. Duy cụm camera v&agrave; mặt lưng k&iacute;nh l&agrave; &iacute;t chịu t&aacute;c động của trầy xước.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="Galaxy Z Fold 2 đã vượt qua được bài kiểm tra bụi bẩn mà bản tiền nhiệm đã phải bó tay - Ảnh 5." id="img_236742300249268224" src="https://genk.mediacdn.vn/thumb_w/660/139269124445442048/2020/10/3/2020-10-03134317-16017077617691305418139.jpg" style="max-width:100%" title="Galaxy Z Fold 2 đã vượt qua được bài kiểm tra bụi bẩn mà bản tiền nhiệm đã phải bó tay - Ảnh 5." /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tới b&agrave;i kiểm tra hơ lửa, cả hai m&agrave;n h&igrave;nh ch&iacute;nh v&agrave; phụ của m&aacute;y gần như kh&ocirc;ng gặp vấn đề g&igrave; khi m&agrave;n h&igrave;nh c&oacute; thể tự hồi sau khi bị hơ lửa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="Galaxy Z Fold 2 đã vượt qua được bài kiểm tra bụi bẩn mà bản tiền nhiệm đã phải bó tay - Ảnh 6." id="img_236742300960104448" src="https://genk.mediacdn.vn/thumb_w/660/139269124445442048/2020/10/3/2020-10-03134403-16017077619672039173237.jpg" style="max-width:100%" title="Galaxy Z Fold 2 đã vượt qua được bài kiểm tra bụi bẩn mà bản tiền nhiệm đã phải bó tay - Ảnh 6." /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Cuối c&ugrave;ng l&agrave; thử th&aacute;ch bẻ cong m&agrave;n h&igrave;nh. Đ&acirc;y l&agrave; thử th&aacute;ch kh&oacute; nhằn nhất m&agrave; bất kỳ một thiết bị n&agrave;o cũng kh&ocirc;ng muốn phải trải qua.</p>', 'ssdfsd', '2020-09-17 13:31:24', '2020-10-05 02:26:55', 'PUBLISHED'),
(22, 1, 1, 5, 'Ảnh Chánh văn phòng Nhà Trắng gục đầu gây chú ý', 'anh-chanh-van-phong-nha-trang-guc-au-gay-chu-y', '<p>Bức ảnh Ch&aacute;nh văn ph&ograve;ng Nh&agrave; Trắng Mark Meadows ngồi gục đầu, hai tay xoa tr&aacute;n đang được chia sẻ rộng r&atilde;i v&agrave; l&agrave;m dấy l&ecirc;n nhiều đồn đo&aacute;n.</p>\r\n\r\n<p>Ph&oacute;ng vi&ecirc;n ảnh Erin Scott chụp được khoảnh khắc tr&ecirc;n trong buổi họp b&aacute;o ng&agrave;y 4/10, khi b&aacute;c sĩ Nh&agrave; Trắng Sean Conley cung cấp th&ocirc;ng tin cập nhật cho truyền th&ocirc;ng về t&igrave;nh h&igrave;nh sức khỏe của Tổng thống Donald Trump, người đang điều trị trong Trung t&acirc;m Qu&acirc;n y Quốc gia Walter Reed v&igrave; Covid-19.</p>\r\n\r\n<p><img alt="Chánh văn phòng Nhà Trắng Mark Meadows ngồi gục đầu, hai tay xoa trán trong lúc bác sĩ Sean Conley họp báo về sức khỏe của Tổng thống hôm 4/10. Ảnh: Reuters." class="lazied lazy" src="https://i1-vnexpress.vnecdn.net/2020/10/05/chanh-van-phong-2937-1601860297.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=7z7HfYVTuHlw7of-v-sSNQ" style="left:0; position:absolute; width:100%" /></p>\r\n\r\n<p>Meadows ngồi gục đầu trong l&uacute;c b&aacute;c sĩ Conley họp b&aacute;o h&ocirc;m 4/10. Ảnh: <em>Reuters</em>.</p>\r\n\r\n<p>C&aacute;c ph&oacute;ng vi&ecirc;n kh&aacute;c của Reuters v&agrave; ABC News cũng chia sẻ bức ảnh n&agrave;y. Một số người b&igrave;nh luận về bức ảnh, gồm ph&oacute;ng vi&ecirc;n Jonathan Lemire của AP. &quot;Bức ảnh n&oacute;i l&ecirc;n &iacute;t nhất 1.000 từ về cuối tuần n&agrave;y&quot;, Lemire cho hay.</p>\r\n\r\n<p>Người dẫn chương tr&igrave;nh Greta Van Susteren cho rằng Ch&aacute;nh văn ph&ograve;ng &quot;c&oacute; lẽ đ&atilde; kh&ocirc;ng ngủ&quot; kể từ ng&agrave;y 1/10, sau khi Tổng thống được x&aacute;c định dương t&iacute;nh Covid-19.</p>', 'ertert', '2020-09-17 14:38:48', '2020-10-05 02:28:28', 'PUBLISHED'),
(23, 1, 1, 6, 'Điểm danh những nạn nhân đã từng nếm "độ mặn" của Apple', 'iem-danh-nhung-nan-nhan-a-tung-nem-o-man-cua-apple', '<p>Epic l&agrave; kẻ đầu ti&ecirc;n trong lịch sử d&aacute;m cố t&igrave;nh th&aacute;ch thức Apple bằng c&aacute;ch đưa phương thức thanh to&aacute;n ri&ecirc;ng v&agrave;o Fortnite phi&ecirc;n bản iOS, qua mặt khoản ph&iacute; 30% của App Store. Ngay lập tức, Apple đ&atilde; x&oacute;a Fortnite khỏi chợ ứng dụng iOS. V&agrave;i ng&agrave;y sau, xuất hiện ngay tr&ecirc;n trang nhất của App Store l&agrave; PUBG, tựa game cạnh tranh số 1 với Fortnite.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a class="detail-img-lightbox" href="https://genk.mediacdn.vn/139269124445442048/2020/10/2/layer-2-1601627672712860287924.png" style="color: rgb(84, 84, 84);" target="_blank" title=""><img alt="Điểm danh những nạn nhân đã từng nếm độ mặn của Apple: Epic, Spotify, Qualcomm, Facebook và FBI - Ảnh 2." class="lightbox-content" id="img_236406381902209024" src="https://genk.mediacdn.vn/139269124445442048/2020/10/2/layer-2-1601627672712860287924.png" style="max-width:100%" title="Điểm danh những nạn nhân đã từng nếm độ mặn của Apple: Epic, Spotify, Qualcomm, Facebook và FBI - Ảnh 2." /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tiếp theo, Apple dọa cắt đứt hỗ trợ c&aacute;c t&agrave;i khoản Unreal Engine (nền tảng ph&aacute;t triển game của Epic). Tuy t&ograve;a &aacute;n kh&ocirc;ng cho ph&eacute;p Apple thực hiện động th&aacute;i tr&ecirc;n, r&otilde; r&agrave;ng l&agrave; Tim Cook chẳng cần tung đ&ograve;n m&agrave; đối thủ đ&atilde; đau: theo khẳng định từ ch&iacute;nh Epic, nhiều nh&agrave; ph&aacute;t triển đ&atilde; từ bỏ Unreal Engine v&igrave; e ngại về tương lai bấp b&ecirc;nh của nền tảng n&agrave;y.</p>\r\n\r\n<p>Chưa hết, Apple dọa loại bỏ t&iacute;nh năng đăng nhập Fortnite, Epic vội v&atilde; &quot;la l&agrave;ng&quot;. Nhưng &iacute;t ng&agrave;y sau, nh&agrave; T&aacute;o thủng thẳng tuy&ecirc;n bố với <em>The Verge</em>&nbsp;v&agrave; <em>Fox Business</em>: đ&acirc;u phải đ&acirc;u, Apple chẳng hề c&oacute; &yacute; định l&agrave;m vậy. Như thế, ph&aacute;t triển Fornite đ&atilde; bước thẳng v&agrave;o c&aacute;i bẫy truyền th&ocirc;ng của nh&agrave; T&aacute;o.</p>\r\n\r\n<p>&quot;Mặn&quot; nhất, c&ocirc;ng ty của Tim Cook đ&atilde; n&oacute;i trắng ra rằng Fortnite đang dần hết thời: th&aacute;ng 7/2020, sự quan t&acirc;m đến Fortnite đ&atilde; giảm gần 70% so với th&aacute;ng 10/2019. Epic kiện tụng chỉ để thu h&uacute;t sự ch&uacute; &yacute; trở lại với tựa game số 1 của m&igrave;nh m&agrave; th&ocirc;i.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a class="detail-img-lightbox" href="https://genk.mediacdn.vn/139269124445442048/2020/10/2/layer-3-16016276727161712211714.png" style="color: rgb(84, 84, 84);" target="_blank" title=""><img alt="Điểm danh những nạn nhân đã từng nếm độ mặn của Apple: Epic, Spotify, Qualcomm, Facebook và FBI - Ảnh 3." class="lightbox-content" id="img_236406383831134208" src="https://genk.mediacdn.vn/139269124445442048/2020/10/2/layer-3-16016276727161712211714.png" style="max-width:100%" title="Điểm danh những nạn nhân đã từng nếm độ mặn của Apple: Epic, Spotify, Qualcomm, Facebook và FBI - Ảnh 3." /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a class="detail-img-lightbox" href="https://genk.mediacdn.vn/139269124445442048/2020/10/2/layer-4-16016276727311874697613.png" style="color: rgb(84, 84, 84);" target="_blank" title=""><img alt="Điểm danh những nạn nhân đã từng nếm độ mặn của Apple: Epic, Spotify, Qualcomm, Facebook và FBI - Ảnh 4." class="lightbox-content" id="img_236406380589387776" src="https://genk.mediacdn.vn/139269124445442048/2020/10/2/layer-4-16016276727311874697613.png" style="max-width:100%" title="Điểm danh những nạn nhân đã từng nếm độ mặn của Apple: Epic, Spotify, Qualcomm, Facebook và FBI - Ảnh 4." /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Một trong những kẻ l&ecirc;n tiếng ủng hộ Epic đầu ti&ecirc;n l&agrave; Spotify. Năm 2019, Spotify đ&atilde; đệ đơn kiện Apple về khoản ph&iacute; 30% m&agrave; c&aacute;c nh&agrave; ph&aacute;t triển phải chia sẻ với Apple. Sự đ&aacute;p trả của Apple d&agrave;nh cho Spotify cũng đầy đủ v&agrave; r&otilde; r&agrave;ng như với Epic: trong con mắt của nh&agrave; T&aacute;o, dịch vụ stream nhạc số 1 thế giới đơn giản l&agrave; chỉ muốn tận hưởng đầy đủ c&aacute;c lợi thế về cộng đồng người d&ugrave;ng, c&aacute;c c&ocirc;ng cụ ph&aacute;t triển, hệ thống thanh to&aacute;n bảo mật&hellip; m&agrave; kh&ocirc;ng phải tốn một xu n&agrave;o cho App Store cả.</p>', NULL, '2020-10-05 02:58:58', '2020-10-05 02:58:58', 'PUBLISHED');
INSERT INTO `post` (`post_id`, `user_add_id`, `user_upd_id`, `category_id`, `title`, `slug`, `content`, `tags`, `date_add`, `date_upd`, `status`) VALUES
(24, 1, 1, 6, 'Bảo mật bằng OTP vẫn có thể bị chiếm tài khoản ngân hàng', 'bao-mat-bang-otp-van-co-the-bi-chiem-tai-khoan-ngan-hang', '<p>Hacker c&oacute; thể &quot;đọc trộm&quot; m&atilde; OTP tr&ecirc;n smartphone, rồi thực hiện giao dịch tr&ecirc;n một thiết bị kh&aacute;c m&agrave; người d&ugrave;ng kh&ocirc;ng biết.</p>\r\n\r\n<p>Ng&agrave;y 4/9, t&agrave;i khoản của &ocirc;ng Trần Việt Luận (TP HCM) bị k&iacute;ch hoạt ứng dụng VCB Digibank tr&ecirc;n thiết bị kh&aacute;c v&agrave; chuyển 406 triệu cho người thụ hưởng tại MSB, SEABank trong v&ograve;ng 7 ph&uacute;t. V&igrave; kh&ocirc;ng nhận được tin nhắn th&ocirc;ng b&aacute;o m&atilde; x&aacute;c thực, biến động số dư qua điện thoại n&ecirc;n &ocirc;ng kh&ocirc;ng ph&aacute;t hiện cho đến khi ra ng&acirc;n h&agrave;ng giao dịch.</p>\r\n\r\n<p>&quot;Trong năm qua, ch&uacute;ng t&ocirc;i biết c&oacute; nhiều vụ đ&aacute;nh cắp t&agrave;i khoản ng&acirc;n h&agrave;ng m&agrave; hacker khai th&aacute;c điểm yếu của c&ocirc;ng nghệ x&aacute;c thực SMS OTP&quot;, &ocirc;ng Nguyễn Tử Quảng, CEO Bkav n&oacute;i. &Ocirc;ng cho rằng, vụ t&agrave;i khoản ng&acirc;n h&agrave;ng <a href="https://vnexpress.net/tai-khoan-ngan-hang-boc-hoi-406-trieu-trong-vai-phut-4171383.html" rel="dofollow">&quot;bốc hơi&quot; 406 triệu đồng</a> cũng li&ecirc;n quan đến việc hacker khai th&aacute;c c&aacute;c điểm yếu n&agrave;y.</p>\r\n\r\n<p>OTP (mật khẩu d&ugrave;ng một lần) gửi qua tin nhắn SMS l&agrave; phương ph&aacute;p x&aacute;c thực bảo mật được sử dụng nhiều, nhất l&agrave; trong những lĩnh vực như t&agrave;i ch&iacute;nh, ng&acirc;n h&agrave;ng. Chẳng hạn trong giao dịch chuyển tiền, dịch vụ sẽ y&ecirc;u cầu người thực hiện nhập th&ecirc;m m&atilde; OTP được gửi đến số điện thoại c&aacute; nh&acirc;n để đảm bảo ch&iacute;nh chủ thực hiện giao dịch. D&ugrave; l&agrave; một bước trong quy tr&igrave;nh bảo mật hai lớp, theo c&aacute;c chuy&ecirc;n gia bảo mật, OTP vẫn c&oacute; thể bị hacker khai th&aacute;c, đặc biệt l&agrave; với người d&ugrave;ng smartphone.</p>\r\n\r\n<p><img alt="Mã OTP được gửi về điện thoại qua SMS có thể bị hacker khai thác qua phần mềm gián điệp hoặc website mạo danh." class="lazied lazy" src="https://i1-sohoa.vnecdn.net/2020/10/06/otp-hack-9886-1601975480.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=OQGjuoIjVQcD7D4Q_DpIJQ" style="left:0; position:absolute; width:100%" /></p>\r\n\r\n<p>X&aacute;c thực giao dịch bằng SMS OTP l&agrave; c&aacute;ch m&agrave; nhiều ng&acirc;n h&agrave;ng đang sử dụng hiện nay. Ảnh: <em>Lưu Qu&yacute;</em></p>\r\n\r\n<p>&Ocirc;ng Quảng giải th&iacute;ch, hacker c&oacute; &iacute;t nhất hai c&aacute;ch để lấy được m&atilde; OTP trong SMS của người d&ugrave;ng. Thứ nhất, hacker lừa nạn nh&acirc;n nhập m&atilde; OTP v&agrave;o một website giả mạo để chiếm m&atilde;; ngo&agrave;i ra, ch&uacute;ng c&oacute; thể lừa nạn nh&acirc;n c&agrave;i phần mềm gi&aacute;n điệp l&ecirc;n smartphone. Phần mềm gi&aacute;n điệp sẽ theo d&otilde;i tất cả th&ocirc;ng tin, trong đ&oacute; c&oacute; tin nhắn SMS chứa m&atilde; OTP v&agrave; c&aacute;c th&ocirc;ng tin đăng nhập v&agrave;o ứng dụng Mobile Banking. Với cả hai c&aacute;ch tr&ecirc;n, hacker ho&agrave;n to&agrave;n c&oacute; thể chiếm được m&atilde; OTP v&agrave; thực hiện c&aacute;c giao dịch giả mạo.</p>\r\n\r\n<p>Theo &ocirc;ng Quảng, điểm yếu lớn nhất của phương ph&aacute;p SMS OTP l&agrave; thiếu t&iacute;nh &quot;chống chối bỏ&quot;, tạo kẽ hở để hacker thực hiện c&aacute;c giao dịch ng&acirc;n h&agrave;ng tr&ecirc;n một thiết bị lạ.</p>\r\n\r\n<p>Thiếu t&iacute;nh &quot;chống chối bỏ&quot; nghĩa l&agrave; hệ thống kh&ocirc;ng thể x&aacute;c minh được ai đang thực hiện giao dịch. V&iacute; dụ, nếu kẻ xấu dụ người d&ugrave;ng truy cập một trang chuyển tiền giả mạo, mọi th&ocirc;ng tin người d&ugrave;ng nhập v&agrave;o sẽ được chuyển tới kẻ xấu. Khi đ&oacute;, ch&uacute;ng sẽ c&oacute; th&ocirc;ng tin đăng nhập v&agrave; m&atilde; OTP để thực hiện giao dịch ở một thiết bị kh&aacute;c. Hệ thống kh&ocirc;ng c&oacute; khả năng x&aacute;c định ai thực hiện giao dịch tr&ecirc;n. Theo &ocirc;ng Nguyễn Văn Cường, Trưởng ph&ograve;ng An ninh mạng của Bkav, hiện nay, nhiều nước tr&ecirc;n thế giới đ&atilde; ứng dụng c&aacute;c phương ph&aacute;p bảo mật c&oacute; t&iacute;nh &quot;chống chối bỏ&quot; nhằm khắc phục kẽ hở n&agrave;y. M&atilde; x&aacute;c thực sẽ được cung cấp cho một thiết bị duy nhất để đảm bảo an to&agrave;n v&agrave; người d&ugrave;ng phải chịu tr&aacute;ch nhiệm về việc bảo quản m&atilde; đ&oacute;.</p>\r\n\r\n<p>Trong sự cố của &ocirc;ng Trần Việt Luận, đại diện Vietcombank cho biết &quot;đ&acirc;y l&agrave; trường hợp nghi ngờ bị giả mạo giao dịch qua ứng dụng VCB Digibank dẫn đến bị r&uacute;t tiền trong t&agrave;i khoản&quot;.</p>\r\n\r\n<p>T&agrave;i khoản của kh&aacute;ch h&agrave;ng bị k&iacute;ch hoạt ứng dụng VCB Digibank tr&ecirc;n thiết bị kh&aacute;c. Vietcombank dẫn x&aacute;c nhận của nh&agrave; mạng cho thấy đ&atilde; gửi tổng cộng 8 tin nhắn (4 tin x&aacute;c thực v&agrave; 4 tin biến động số dư) đến điện thoại kh&aacute;ch h&agrave;ng, trong khi người n&agrave;y kh&ocirc;ng nhận được bất kỳ tin nhắn n&agrave;o. Vụ việc n&agrave;y vẫn đang tiếp tục điều tra.</p>\r\n\r\n<p>&Ocirc;ng V&otilde; Đỗ Thắng, Gi&aacute;m đốc Trung t&acirc;m an ninh mạng Athena, người từng nhiều năm theo d&otilde;i t&igrave;nh h&igrave;nh an ninh mạng tại Việt Nam, cho biết việc tấn c&ocirc;ng t&agrave;i khoản bằng c&aacute;ch khai th&aacute;c m&atilde; OTP xảy ra kh&aacute; thường xuy&ecirc;n thời gian qua, kh&ocirc;ng chỉ ở Việt Nam m&agrave; tr&ecirc;n to&agrave;n thế giới. Tuy nhi&ecirc;n, theo &ocirc;ng Thắng, yếu tố quyết định sự an to&agrave;n nằm ở người d&ugrave;ng chứ kh&ocirc;ng phải phương ph&aacute;p.</p>\r\n\r\n<p>&Ocirc;ng cho rằng nguy&ecirc;n nh&acirc;n ch&iacute;nh của c&aacute;c vụ đ&aacute;nh cắp t&agrave;i khoản đến từ sự chủ quan v&agrave; thiếu kinh nghiệm tự bảo vệ của người d&ugrave;ng smartphone. Nhiều người thoải m&aacute;i đăng nhập Wi-Fi c&ocirc;ng cộng, hoặc tải phần mềm gi&aacute;n điệp về m&aacute;y m&agrave; kh&ocirc;ng biết. Hacker ho&agrave;n to&agrave;n c&oacute; thể khai th&aacute;c th&oacute;i quen n&agrave;y để lấy được m&atilde; OTP của người d&ugrave;ng. &quot;Bảo mật hai lớp bằng OTP cũng sẽ trở n&ecirc;n k&eacute;m an to&agrave;n nếu ch&uacute;ng ta sử dụng tr&ecirc;n một thiết bị kh&ocirc;ng an to&agrave;n&quot;, &ocirc;ng Thắng n&oacute;i.</p>\r\n\r\n<p>Theo c&aacute;c chuy&ecirc;n gia bảo mật, người d&ugrave;ng c&oacute; thể tự ph&ograve;ng tr&aacute;nh c&aacute;c nguy cơ bị chiếm t&agrave;i khoản bằng c&aacute;ch kh&ocirc;ng click v&agrave;o c&aacute;c link lạ, đặc biệt l&agrave; khi thực hiện giao dịch tiền bạc. Người d&ugrave;ng kh&ocirc;ng c&agrave;i đặt ứng dụng lạ từ c&aacute;c nguồn kh&ocirc;ng ch&iacute;nh thống. Khi c&agrave;i đặt phần mềm mới, kh&ocirc;ng cung cấp qu&aacute; nhiều quyền cho c&aacute;c ứng dụng, như đọc SMS, truy cập Internet... nếu kh&ocirc;ng cần thiết. Ngo&agrave;i ra, những người smartphone cũng n&ecirc;n sử dụng c&aacute;c phần mềm chống m&atilde; độc để bảo vệ thiết bị.</p>\r\n\r\n<p>Chuy&ecirc;n gia bảo mật Nguyễn Văn Cường cho rằng, c&aacute;c dịch vụ, đặc biệt dịch vụ ng&acirc;n h&agrave;ng cần c&oacute; cảnh b&aacute;o đến người d&ugrave;ng khi ph&aacute;t hiện đăng nhập từ một thiết bị mới. Ngo&agrave;i ra, c&aacute;c đơn vị n&agrave;y c&oacute; thể ứng dụng phương ph&aacute;p bảo mật bằng chữ k&yacute; số. &quot;Chữ k&yacute; số&quot; l&agrave; một thiết bị cắm ngo&agrave;i, hoặc nằm tr&ecirc;n thiết bị nhưng định danh gắn liền với thiết bị đ&oacute;. Ưu điểm của chữ k&yacute; số l&agrave; x&aacute;c định được nguồn gốc người gửi, do đ&oacute; n&oacute; c&oacute; t&iacute;nh chất &quot;chống chối bỏ&quot; v&agrave; được ph&aacute;p luật bảo hộ theo Nghị Định 130/2018/NĐ-CP.</p>\r\n\r\n<p>Mặc d&ugrave; phương ph&aacute;p n&agrave;y phổ biến tr&ecirc;n thế giới v&agrave; hiện được nhiều lĩnh vực tại Việt Nam như Hải Quan, Bảo hiểm, Thuế, sử dụng, &ocirc;ng Cường cho biết phương ph&aacute;p n&agrave;y hiện chưa được c&aacute;c ng&acirc;n h&agrave;ng ph&aacute;t triển v&igrave; một số r&agrave;o cản về ph&aacute;p l&yacute; khi d&ugrave;ng tr&ecirc;n di động. Đồng thời chữ k&yacute; số c&ograve;n bất tiện hơn so với OTP khi chuyển đổi giao dịch giữa c&aacute;c thiết bị kh&aacute;c nhau.</p>\r\n\r\n<p style="text-align:right"><strong>Lưu Qu&yacute;</strong></p>', NULL, '2020-10-07 07:49:52', '2020-10-07 07:49:52', 'PUBLISHED');
