INSERT INTO `product` (`product_id`, `manufacturer_id`, `category_default_id`, `quantity`, `price`, `unity`, `active`, `condition`, `show_price`, `date_add`, `date_upd`, `slug`, `name`, `description`, `description_short`, `config`) VALUES
(5, 2, 1, 1, '0.001', 'mon', 1, 'new', 1, '2020-09-11 02:25:52', '2020-10-01 17:15:37', 'intel-va-nvidia-coi-chung', 'Intel và NVIDIA coi chừng', '<p>V&agrave;o tuần trước, NVIDIA đ&atilde; h&eacute; lộ d&ograve;ng card đồ họa sử dụng kiến tr&uacute;c Ampere ho&agrave;n to&agrave;n mới mang t&ecirc;n RTX 3000. Với hiệu năng vượt trội hơn đ&aacute;ng kể so với mẫu flagship tiền nhiệm RTX 2080/2080 Ti, d&ograve;ng card đồ họa n&agrave;y c&ograve;n thu h&uacute;t sự ch&uacute; &yacute; của người d&ugrave;ng c&ocirc;ng nghệ nhờ mức gi&aacute; cực kỳ hấp dẫn. N&oacute;i c&aacute;ch kh&aacute;c, NVIDIA đ&atilde; d&ugrave;ng ch&iacute;nh vũ kh&iacute; hiệu năng/gi&aacute; th&agrave;nh (p/p) quen thuộc của AMD để phả hơi n&oacute;ng l&ecirc;n Đội Đỏ.</p>\r\n\r\n<p>Tr&ecirc;n thực tế, nhiều người d&ugrave;ng sau khi xem xong sự kiện h&eacute; lộ của Nvidia đ&atilde; rất t&ograve; m&ograve; về việc liệu AMD sẽ tung ra sản phẩm g&igrave; để đ&aacute;p trả lại d&ograve;ng card đồ họa RTX 3000 cực &quot;n&oacute;ng&quot; của đối thủ cạnh tranh. Một số &iacute;t thậm ch&iacute; c&ograve;n cho rằng, AMD kh&oacute; c&oacute; thể đưa ra một đối thủ xứng tầm với RTX 3000 Series.&nbsp;</p>\r\n\r\n<p>Tuy nhi&ecirc;n, kh&ocirc;ng để người d&ugrave;ng đợi l&acirc;u, AMD cuối c&ugrave;ng cũng ch&iacute;nh thức tuy&ecirc;n bố sẽ tr&igrave;nh l&agrave;ng d&ograve;ng card đồ họa ho&agrave;n to&agrave;n mới v&agrave;o ng&agrave;y 28/10 tới đ&acirc;y.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a class="detail-img-lightbox" href="https://genk.mediacdn.vn/139269124445442048/2020/9/10/photo-1-15997229346951901567298.jpg" style="color: rgb(84, 84, 84);" target="_blank" title="Dòng card đồ họa RX 6000 mang lại hiệu năng có thể đấu sòng phẳng với các mẫu card đồ họa tầm trung &amp; flagship của Nvidia"><img alt="Intel và NVIDIA coi chừng, AMD sắp hé lộ “kho vũ khí” mới cực kỳ lợi hại ngay trong tháng 10 - Ảnh 1." class="lightbox-content" id="img_228417341670105088" src="https://genk.mediacdn.vn/thumb_w/660/139269124445442048/2020/9/10/photo-1-15997229346951901567298.jpg" style="max-width:100%" title="Intel và NVIDIA coi chừng, AMD sắp hé lộ “kho vũ khí” mới cực kỳ lợi hại ngay trong tháng 10 - Ảnh 1." /></a></p>\r\n\r\n<p>D&ograve;ng card đồ họa RX 6000 mang lại hiệu năng c&oacute; thể đấu s&ograve;ng phẳng với c&aacute;c mẫu card đồ họa tầm trung &amp; flagship của Nvidia</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo đ&oacute;, d&ograve;ng card đồ họa mới n&agrave;y c&oacute; t&ecirc;n gọi Radeon RX 6000 Series. So với d&ograve;ng card đồ họa RX 5000 sử dụng kiến tr&uacute;c RDNA, RX 6000 Series &nbsp;sẽ sử dụng kiến tr&uacute;c RDNA 2 ho&agrave;n to&agrave;n mới, mang đến rất nhiều t&iacute;nh năng đ&aacute;ng ch&uacute; &yacute;.&nbsp;</p>', '<p>Với việc c&ocirc;ng bố c&ugrave;ng l&uacute;c 2 d&ograve;ng sản phẩm chủ lực, điều n&agrave;y cũng c&oacute; nghĩa AMD sẽ phải đối đầu c&ugrave;ng l&uacute;c với 2 đối thủ cạnh tranh cực mạnh l&agrave; Nvidia v&agrave; Intel</p>', '{"0": [12], "1": [13], "2": [14]}'),
(6, 1, 5, 1, '0.001', 'mon', 1, 'new', 1, '2020-09-25 07:25:20', '2020-10-01 17:16:06', 'oi-dung-nhung-thiet-bi-vsmart-se-co-the-xem-noi-dung-full-hd', 'ời dùng những thiết bị Vsmart sẽ có thể xem nội dung Full HD', '<p>Netflix l&agrave; một ứng dụng đ&ograve;i hỏi nhiều y&ecirc;u cầu khắt khe từ thiết bị. B&ecirc;n cạnh những yếu tố hiển nhi&ecirc;n như chất lượng m&agrave;n h&igrave;nh (độ ph&acirc;n giải, khả năng t&aacute;i tạo nội dung HDR), tốc độ đường truyền hay g&oacute;i Netflix m&agrave; người d&ugrave;ng đăng k&yacute;; để c&oacute; thể trải nghiệm Netflix một c&aacute;ch trọn vẹn, một thiết bị Android phải c&oacute; được hai chứng chỉ sau:</p>\r\n\r\n<p><strong>1. Google Play Protect: </strong>Đ&acirc;y l&agrave; chứng chỉ của Google nhằm đảm bảo một thiết bị l&agrave; hợp lệ v&agrave; an to&agrave;n. Một thiết bị kh&ocirc;ng đạt Play Protect sẽ kh&ocirc;ng thể c&agrave;i đặt ứng dụng Netflix tr&ecirc;n Play Store (nhưng vẫn c&oacute; thể c&agrave;i qua file APK ngo&agrave;i). Trước đ&acirc;y, chiếc Bphone B86 của BKAV cũng từng gặp phải vấn đề tương tự.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="Ơn trời, điện thoại Vsmart cuối cùng đã có chứng chỉ Widevine L1! - Ảnh 1." id="img_231679892497084416" src="https://genk.mediacdn.vn/thumb_w/660/139269124445442048/2020/9/19/dscf5357-1590832750120364509257-16005007847411219131365.jpg" style="max-width:100%" title="Ơn trời, điện thoại Vsmart cuối cùng đã có chứng chỉ Widevine L1! - Ảnh 1." /></p>\r\n\r\n<p>Bphone B86 kh&ocirc;ng thể c&agrave;i Netflix qua Play Store do kh&ocirc;ng đạt Play Protect</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. Widevine L1:</strong> Widevine l&agrave; nền tảng DRM (Digital Rights Management) của Google. Bạn kh&ocirc;ng cần hiểu qu&aacute; nhiều về n&oacute;, m&agrave; chỉ cần biết rằng một thiết bị Android phải đạt chuẩn Widevine L1 th&igrave; mới c&oacute; thể xem Netflix ở độ ph&acirc;n giải Full HD. Nếu kh&ocirc;ng đạt chuẩn n&agrave;y, thiết bị đ&oacute; sẽ chỉ c&oacute; thể xem Netflix ở độ ph&acirc;n giải ti&ecirc;u chuẩn (SD 540p), kể cả khi những điều kiện về m&agrave;n h&igrave;nh, đường truyền hay g&oacute;i Netflix ở tr&ecirc;n được thoả m&atilde;n.</p>\r\n\r\n<p><strong>Vậy vấn đề của Netflix tr&ecirc;n c&aacute;c thiết bị Vsmart ra sao?</strong> Ngay từ thời điểm ban đầu, Vsmart đ&atilde; c&oacute; chứng chỉ Google Play Protect, đồng nghĩa với việc người d&ugrave;ng c&oacute; thể dễ d&agrave;ng tải ứng dụng n&agrave;y tr&ecirc;n Play Store. Thế nhưng v&igrave; một l&yacute; do n&agrave;o đ&oacute;, to&agrave;n bộ dải sản phẩm Vsmart lại thiếu vắng chứng chỉ Widevine L1, khiến cho kh&ocirc;ng một chiếc m&aacute;y n&agrave;o c&oacute; thể xem được Netflix ở độ ph&acirc;n giải Full HD. Đ&acirc;y l&agrave; một điều rất đ&aacute;ng tiếc, bởi lẽ một số thiết bị Vsmart như Live hay Active 3 sở hữu m&agrave;n h&igrave;nh AMOLED với chất lượng tương đối tốt.</p>', '<p>Với chứng chỉ n&agrave;y, người d&ugrave;ng những thiết bị Vsmart sẽ c&oacute; thể xem nội dung Full HD tr&ecirc;n Netflix, thay v&igrave; bị giới hạn ở mức SD như trước đ&acirc;y.</p>', '{"0": [1, 12], "1": [2, 12], "2": [3, 12], "3": [1, 13], "4": [2, 13], "5": [3, 13]}'),
(7, 2, 3, 1, '0.001', 'mon', 1, 'new', 1, '2020-09-28 09:06:01', '2020-10-01 17:16:25', 'may-giac', 'may giac', '<p>may giac</p>', '<p>may giac</p>', '{"0": [12, 10, 1], "1": [13, 10, 1], "2": [12, 11, 1], "3": [13, 11, 1], "4": [12, 10, 3], "5": [13, 10, 3], "6": [12, 11, 3], "7": [13, 11, 3], "8": [12, 10, 2], "9": [13, 10, 2], "10": [12, 11, 2], "11": [13, 11, 2]}'),
(8, 2, 3, 10, '0.000', 'mon', 1, 'new', 1, '2020-09-30 01:57:28', '2020-10-01 17:16:43', 'ien-thoai-smartphone-chinh-hang-gia-re', 'Điện thoại, smartphone chính hãng giá rẻ', '<p><strong>Mua điện thoại Samsung Galaxy S20 Ultra ch&iacute;nh h&atilde;ng, gi&aacute; rẻ tại Ho&agrave;ng H&agrave; Mobile</strong></p>\r\n\r\n<p>Galaxy S20 l&agrave; d&ograve;ng sản phẩm mới sắp được Samsung cho ra mắt. Trong ba phi&ecirc;n bản đ&atilde; giới thiệu trước đ&oacute; th&igrave; Samsung Galaxy S20 Ultra l&agrave; phi&ecirc;n bản cao cấp nhất. M&aacute;y được trang bị nhiều t&iacute;nh năng tuyệt vời c&ugrave;ng th&ocirc;ng số ấn tượng.</p>\r\n\r\n<p>M&agrave;n h&igrave;nh AMOLED Full HD k&iacute;ch thước l&ecirc;n tới 6.9 inch</p>\r\n\r\n<p><img src="https://hoanghamobile.com/Uploads/Originals/2020/02/05/202002051026187329_1.jpg" style="height:351px; width:625px" /></p>\r\n\r\n<p>Thiết kế của Samsung Galaxy S20 Ultra tương đối giống với hai phi&ecirc;n bản Galaxy S20 v&agrave; Galaxy S20 +. C&oacute; lẽ điểm kh&aacute;c biệt r&otilde; r&agrave;ng nhất l&agrave; k&iacute;ch thước của sản phẩm. Galaxy S20 Ultra sở hữu m&agrave;n h&igrave;nh với k&iacute;ch thước l&ecirc;n tới 6.9 inch, lớn hơn hẳn hai thiết bị c&ograve;n lại. Tấm nền AMOLED c&ugrave;ng độ ph&acirc;n giải Full HD sẽ mang đến h&igrave;nh ảnh hiển thị v&ocirc; c&ugrave;ng sắc n&eacute;t.</p>\r\n\r\n<p>Mặc d&ugrave; vẫn l&agrave; m&agrave;n h&igrave;nh lỗ bấm nhưng m&aacute;y lại được trang bị tần số qu&eacute;t l&ecirc;n tới 120 Hz. Tần số n&agrave;y sẽ tăng độ nhạy cho cảm ứng. Nhờ đ&oacute; c&aacute;c thao t&aacute;c vuốt, chạm sẽ trở n&ecirc;n ch&acirc;n thực, mượt m&agrave; hơn. Bạn sẽ cảm nhận rất r&otilde; điều n&agrave;y khi chơi c&aacute;c tựa game đồ họa cao. Đặc biệt c&ocirc;ng nghệ cảm ứng v&acirc;n tay ngay tr&ecirc;n m&agrave;n h&igrave;nh cũng gi&uacute;p thao t&aacute;c nhanh ch&oacute;ng, thuận tiện. B&ecirc;n cạnh đ&oacute;, mặt lưng của m&aacute;y được l&agrave;m bằng k&iacute;nh cường lực cao cấp, sang trọng v&agrave; chống va đập tốt.</p>\r\n\r\n<p>Samsung Galaxy S20 Ultra c&oacute; tơi 4 camera đẳng cấp</p>\r\n\r\n<p><img src="https://hoanghamobile.com/Uploads/Originals/2020/02/05/202002051026187339_2.jpg" style="height:353px; width:624px" /></p>\r\n\r\n<p>Samsung đ&atilde; mang đến bộ tứ camera đẳng cấp cho Galaxy S20 Ultra. Đầu ti&ecirc;n phải kể đến camera ch&iacute;nh với độ ph&acirc;n giải l&ecirc;n tới 108 MP. C&oacute; thể đ&acirc;y kh&ocirc;ng phải l&agrave; chiếc smartphone đầu ti&ecirc;n trang bị cảm biến 108 MP nhưng chắc chắn camera của Samsung sẽ được tinh chỉnh để gi&uacute;p tạo ra những bức ảnh đẹp nhất. Camera n&agrave;y c&ograve;n c&oacute; thể zoom quang 5x.</p>\r\n\r\n<p>Tiếp theo l&agrave; camera ToF 3D tương tự như Galaxy Note 10. C&ograve;n lại l&agrave; bộ đ&ocirc;i camera tele 48 MP v&agrave; cảm biến g&oacute;c si&ecirc;u rộng 12 MP. Với cụm camera n&agrave;y, bạn c&oacute; thể quay video 8K 30 fps, zoom quang 10x hoặc zoom điện tử 100x. V&agrave; tất nhi&ecirc;n m&aacute;y sẽ kh&ocirc;ng thể ho&agrave;n chỉnh nếu như thiếu camera selfie 40 MP ở mặt trước. Samsung đ&atilde; t&iacute;ch hợp th&ecirc;m c&aacute;c chế độ l&agrave;m đẹp nhằm gi&uacute;p người d&ugrave;ng c&oacute; được bức ảnh đẹp nhất.</p>\r\n\r\n<p>Hiệu năng mạnh mẽ với hệ điều h&agrave;nh Android 10, chip Exynos 990</p>\r\n\r\n<p><img src="https://hoanghamobile.com/Uploads/Originals/2020/02/05/202002051026187349_3.jpg" style="height:398px; width:624px" /></p>\r\n\r\n<p>Trong ba sản phẩm sắp được ra mắt th&igrave; Galaxy S20 Ultra được trang bị hiệu năng mạnh mẽ nhất. Cụ thể, m&aacute;y sẽ sử dụng chip Exynos 990, con chip được đ&aacute;nh gi&aacute; kh&aacute; cao. N&oacute; sẽ gi&uacute;p xử l&yacute; c&aacute;c tựa game nặng, game đồ họa cao một c&aacute;ch mượt m&agrave;. Nhờ đ&oacute; bạn c&oacute; thể thoải m&aacute;i trải nghiệm mọi loại game m&agrave; kh&ocirc;ng lo giật, l&aacute;c.</p>\r\n\r\n<p>M&aacute;y sở hữu RAM 12 GB v&agrave; bộ nhớ trong dung lượng l&ecirc;n tới 128 GB. Đặc biệt, nếu muốn bạn ho&agrave;n to&agrave;n c&oacute; thể mở rộng bộ nhớ với khe cắm thẻ nhớ microSD. Cho đến thời điểm hiện tại, RAM 12 GB l&agrave; dung lượng cao nhất m&agrave; Samsung đ&atilde; trang bị cho sản phẩm của m&igrave;nh. N&oacute; sẽ xử l&yacute; c&aacute;c t&aacute;c vụ đa nhiệm một c&aacute;ch hiệu quả nhất. Hệ điều h&agrave;nh Android 10 mới nhất cũng sẽ mang đến nhiều trải nghiệm th&uacute; vị cho người d&ugrave;ng.</p>', '<p>Ưu đ&atilde;i mua sạc dự ph&ograve;ng Energizer 10000mAh QE10007PQ trị gi&aacute; 1.000.000đ chỉ với 690.000đ khi mua c&ugrave;ng samsung Galaxy S20 Series (S20 | S20+ | S20 Ultra)</p>', '{"0": [12, 1], "1": [13, 1], "2": [14, 1], "3": [12, 2], "4": [13, 2], "5": [14, 2], "6": [12, 3], "7": [13, 3], "8": [14, 3]}'),
(9, 1, 3, 1, '0.001', 'mon', 1, 'new', 1, '2020-09-30 03:50:04', '2020-10-02 06:42:40', 'anh-gia-vsmart-live-4-khong-the-oi-hoi', 'Đánh giá Vsmart Live 4: Không thể đòi hỏi', '<p>Vsmart Live 4 l&agrave; d&ograve;ng sản phẩm b&igrave;nh d&acirc;n mới nhất của VinSmart nhằm kế nhiệm chiếc Live thế hệ đầu ti&ecirc;n ra mắt hồi năm ngo&aacute;i. Sở hữu Vsmart Live 4 được &quot;nhảy c&oacute;c&quot; t&ecirc;n gọi từ 1 l&ecirc;n 4 l&agrave; do VinSmart muốn c&oacute; sự đồng đều về t&ecirc;n gọi giữa c&aacute;c d&ograve;ng sản phẩm thế hệ thứ 4 (v&iacute; dụ như Star 4, Live 4, tương lai c&oacute; thể l&agrave; Joy 4, Active 4&hellip;).</p>\r\n\r\n<p>Vsmart Live 4 đ&aacute;nh dấu một cột mốc quan trọng với VinSmart, khi đ&acirc;y l&agrave; sản phẩm đầu ti&ecirc;n được h&atilde;ng n&agrave;y tự chủ 100% từ thiết kế phần cứng, hệ điều h&agrave;nh v&agrave; sản xuất. C&oacute; lẽ nhờ việc tự chủ nhiều c&ocirc;ng đoạn hơn, cộng th&ecirc;m việc muốn khuyến kh&iacute;ch người Việt sử dụng c&aacute;c sản phẩm &quot;Make in Vietnam&quot;, vậy n&ecirc;n Vsmart Live 4 c&oacute; mức gi&aacute; rẻ hơn thế hệ tiền nhiệm, cụ thể như sau:</p>\r\n\r\n<p>- Vsmart Live 4 RAM 4GB, ROM 64GB: 4.090.000 đồng.</p>\r\n\r\n<p>- Vsmart Live 4 RAM 6GB, ROM 64GB: 4.490.000 đồng.</p>', '<p>D&ugrave; Vsmart Live 4 c&ograve;n tồn tại một số khiếm khuyết, nhưng khi x&eacute;t một c&aacute;ch tổng thể, người d&ugrave;ng kh&oacute; c&oacute; thể t&igrave;m được một smartphone n&agrave;o kh&aacute;c tốt hơn ở ph&acirc;n kh&uacute;c 4 triệu đồng.</p>', '{"0": [12, 1], "1": [13, 1], "2": [14, 1], "3": [12, 2], "4": [13, 2], "5": [14, 2]}'),
(10, 1, 4, 1, '0.001', 'mon', 1, 'new', 1, '2020-10-02 06:58:36', '2020-10-03 06:33:39', 'nho-kha-nang-nay-loai-meo-co-the-la-cuu-tinh-giup-the-gioi-thoat-khoi-covid-19', 'Nhờ khả năng này, loài mèo có thể là cứu tinh giúp thế giới thoát khỏi COVID-19', '<p>Mặc d&ugrave; một số quốc gia đ&atilde; cố gắng hết sức v&agrave; th&agrave;nh c&ocirc;ng trong việc hạn chế ảnh hưởng của dịch bệnh, th&igrave; đại dịch COVID-19 vẫn đang ho&agrave;nh h&agrave;nh tr&ecirc;n quy m&ocirc; to&agrave;n cầu. Rất nhiều người vẫn đang bị bệnh hoặc sẽ bị ốm trong những tuần v&agrave; th&aacute;ng tới, v&agrave; vắc xin c&oacute; thể l&agrave; c&aacute;ch duy nhất để thực sự chống lại n&oacute;.</p>\r\n\r\n<p>Hiện nay, c&aacute;c nghi&ecirc;n cứu đ&atilde; cho thấy con người kh&ocirc;ng phải l&agrave; lo&agrave;i duy nhất c&oacute; thể nhiễm virus corona. Ch&oacute; v&agrave; m&egrave;o, đ&atilde; được nghi&ecirc;n cứu trong nhiều th&aacute;ng về phản ứng của ch&uacute;ng với virus, dường như cũng c&oacute; khả năng l&acirc;y nhiễm. Nhưng, ph&aacute;t hiện mới đ&acirc;y cho thấy lo&agrave;i m&egrave;o c&oacute; một biện ph&aacute;p bảo vệ đặc biệt m&agrave; cuối c&ugrave;ng c&oacute; thể chứng minh l&agrave; hữu &iacute;ch cho con người.</p>', '<p>g ra th&ocirc;ng b&aacute;o cho hay họ đ&atilde; bỏ kế hoạch tới bang Florida để vận động tranh cử ra khỏi lịch trg ra th&ocirc;ng b&aacute;o cho hay họ đ&atilde; bỏ kế hoạch tới bang Florida để vận động tranh cử ra khỏi lịch trg ra th&ocirc;ng b&aacute;o cho hay họ đ&atilde; bỏ kế hoạch tới bang Florida để vận động tranh cử ra khỏi lịch tr</p>', '{"0": [12, 1], "1": [14, 1], "2": [13, 1], "3": [12, 2], "4": [14, 2], "5": [13, 2], "6": [12, 3], "7": [14, 3], "8": [13, 3]}');
